7','2021-05-18 14:37:26','2021-06-07 14:37:30','00:20:00','1)A et B\r\n2)B\r\n3)B\r\n4)5\r\n5)A\r\n6)C\r\n7)B\r\n8)A\r\n9)C\r\n10)B\r\n11)D\r\n12)C\r\n13)A;B;D\r\n14)B\r\n15)A;B;C\r\n16)A;C;D\r\n17)A;B\r\n18)B\r\n19)A;B;C\r\n20)B\r\n21)C\r\n22)A','',NULL,1,4,31,'2021-06-07 11:07:07','2021-06-07 14:37:43'),(12,'2021-06-07','2021-06-07 09:21:00','2021-06-07 10:21:00','00:20:00','réponses aux qustionnaires',NULL,NULL,1,4,1,'2021-06-07 12:22:38',NULL),(13,'2021-06-07','2021-06-07 08:23:00','2021-06-07 12:00:00','01:00:00','pour','',NULL,1,4,3,'2021-06-07 12:25:00','2021-09-09 15:01:24'),(14,'2021-06-07','2021-06-07 15:00:00','2021-06-07 15:30:00','00:30:00','1) A,B\r\n2) B\r\n3) B\r\n4) D\r\n5) B\r\n6) C\r\n7) B\r\n8) A\r\n9) B\r\n10) B\r\n11) A,D\r\n12) C\r\n13) A,B,D\r\n14) B\r\n15) A,B,C\r\n16) A,D\r\n17) B,C\r\n18) B\r\n19) B\r\n20) B\r\n21) A,C,D\r\n22) A,B\r\n','',NULL,1,4,30,'2021-06-07 15:04:06','2021-06-07 15:17:18'),(15,'2021-06-07','2021-06-07 15:20:00','2021-06-07 15:50:00','00:30:00','1) B-D\r\n2) B\r\n3) B\r\n4) D\r\n5) B\r\n6) C\r\n7) B\r\n8) A\r\n9) B\r\n10) B\r\n11) A-D\r\n12) C\r\n13) A-B-D\r\n14) B\r\n15) A-B-C\r\n16) A-D\r\n17) D\r\n18) B\r\n19) B\r\n20) B\r\n21) A-C-D\r\n22) A\r\n','',NULL,1,4,33,'2021-06-07 15:27:37','2021-06-07 15:29:14'),(16,'2021-06-07','2021-06-07 15:20:00','2021-06-07 00:00:00','00:30:00','1) a et b\r\n2) b\r\n3) b\r\n4) d\r\n5) b\r\n6) c\r\n7) b\r\n8) a\r\n9) b\r\n10)b\r\n11)d\r\n12)c\r\n13)a,b et d\r\n14)b\r\n15)a,b et c\r\n16)a,c et d\r\n17)a,b et d\r\n18)b\r\n19)b\r\n20)b\r\n21)a,c et d\r\n22)a\r\n\r\n','',NULL,1,4,29,'2021-06-07 15:27:47','2021-06-07 15:28:40'),(17,'2021-05-27','2021-06-01 08:05:00','2021-06-01 16:05:00','05:00:00','Réalisation de huit cabines en ossature bois de 250 x 250 x 250 (dimensions internes) avec cloison sur ossature métallique d\'un côté, avec une plaque de placoplâtre (2m50 x 1m20) et une plaque d\'OSB (2m50 x 1m25)','',NULL,1,1,12,'2021-06-07 17:47:55','2021-06-07 18:36:42'),(18,'2021-05-18','2021-05-18 08:05:00','2021-05-18 16:05:00','05:00:00','Déconstruction de cinq cabines nécessitant :\r\n1) la dépose et la récupération de l\'installation électrique (non reliée au compteur)\r\n   - tableau électrique, fils, gaines, interrupteur, prise\r\n2) la dépose et la récupération des menuiseries\r\n   - plinthe, baguette de finition, tasseaux de fixation, tablettes\r\n3) la dépose et la récupération de l\'installation des sanitaires\r\n   - urinoir, robinet poussoir mural, totalité de la tuyauterie cuivre et pvc y compris fixations \r\n4) la dépose de la demi-cloison en plaques de plâtre (récupération de la visserie)\r\n5) la dépose de la cloison en plaques de plâtre (récupération de la visserie)\r\n6) la dépose et la récupération de la totalité de l\'ossature métallique (rails R48 non récupérables)\r\n7) le nettoyage du chantier et le tri des déchets','',NULL,1,1,8,'2021-06-07 19:51:14','2021-06-09 16:45:42'),(19,'2021-06-08','2021-06-08 08:05:00','2021-06-08 16:05:00','05:00:00','Création d\'une cloison de distribution, en L, en plaque de plâtre sur ossature métallique.\r\n- Balisage du chantier sur la longueur des cabines\r\n- Pose de trois pannes de bois, en F, afin de fixer les futures cloisons, de 2m50 x1m75 fixées sur les traverses du bâti bois, par équerres métalliques et vis à bois VBA.\r\n- Pose de l\'ossature métallique de la cloison de face, 1m75 x 2m50 côtes finies, avec rails R48 et montants M48.\r\n- Pose d\'une plaque et demi de placoplâtre avec des vis à \"Placo\" TF, en respectant l\'espace d\'un centimètre au sol.\r\n- Pose de l\'ossature métallique de la cloison de gauche , 1m50 x 2m50, avec rails R48 et montants M48, dont un sabot de 20 cm sur le rail du bas pour la pose d\'un bloc porte.\r\n- Nettoyage du chantier et tri des déchets.\r\n ','Reste à réaliser cause de non réception du bloc-porte :\r\n- Terminer l\'ossature métallique de la cloison de gauche, de l\'emplacement du bloc porte au bout de la pièce, soit 0m90 x 2m50, avec réalisation d\'un imposte et pose d\'un R48 avec sabot de 20cm côté gauche (vue intérieure) du bloc-porte\r\n- Poser \"à blanc\" du bloc-porte\r\n- Vérification des aplombs\r\n- Fixation de l\'ensemble huisserie et ossature métallique\r\n- Pose de plaque de plâtre sur le restant de l\'ossature, imposte compris\r\n- Collage des bandes de joints à plat, des bandes en angle et sans omettre de recouvrir les têtes de vis',NULL,1,1,36,'2021-06-08 19:00:58','2021-06-10 22:58:13'),(20,'2021-06-08','2021-06-08 08:30:00','2021-06-08 16:00:00','05:00:00','Le réalisation de la cloison c\'est déroule bien,en bon binôme,qui est a l’écoute aussi a donnes des idées.',NULL,NULL,1,1,34,'2021-06-08 19:17:22','2021-07-06 17:45:50'),(22,'2021-06-07','2021-06-07 08:05:00','2021-06-07 16:05:00','05:00:00','Dans le but de la création d\'une cloison de distribution, en L, en plaque de plâtre sur ossature métallique.\r\n- Balisage du chantier sur la longueur des cabines\r\n- Pose de trois pannes de bois, en F, afin de fixer les futures cloisons, une de 2m50  et trois de 1m75 fixées sur les traverses du bâti bois, par équerres métalliques et VBA.\r\n- Pose de l\'ossature métallique pour la cloison de face, en rails R48 et montants M48, en 1m75 x 2m50 côtes finies.\r\n- Pose d\'une plaque et demi de placoplâtre maintenue par des vis placo TF, en respectant un espace d\'un centimètre au sol.\r\n- Pose de l\'ossature métallique de la cloison de gauche, en rails R48 et montants M48, 1m50 x 2m50 côtes finies, plus un sabot de 14cm (suite à une erreur de mesure)sur le rail du bas en vue de la pose d\'un bloc-porte.\r\n- Pose d\'une plaque de placoplâtre.\r\n- Nettoyage du chantier et tri des déchets. ','Il reste les 90 cm de la cloison de gauche, à savoir terminer l\'ossature métallique afin d\'avoir une longueur totale de 2m40.\r\nChantier arrêté pour le moment dans l\'attente de la réception du bloc-porte, afin d\'avoir les mesures définitives',NULL,1,1,32,'2021-06-08 19:30:47','2021-06-14 16:21:34'),(25,'2021-06-08','2021-06-08 08:00:00','2021-06-08 16:10:00','05:00:00','Réalisation d\'une cloison en L en plaques de plâtre sur ossature métallique avec bloc porte. \r\nRespect de l\'équerrage.\r\nTraçage au sol à l\'aide de l\'équerre de maçon et report au plafond.\r\nPose des rails et des montants en vérifiant dimensions et niveau(+ retour pour bloc porte).\r\nPose des plaques de plâtre.\r\nNettoyage.\r\n','Pose du bloc porte.',NULL,1,1,35,'2021-06-09 08:34:50','2021-06-15 15:45:15'),(26,'2021-06-08','2021-06-07 15:20:00','2021-06-07 16:05:00','05:00:00','Jour 1 : Réalisation d\'une paroi en plaque de placoplâtre sur ossature métallique et pose du premier rail d\'angle au sol\r\nJour 2 : Démontage du rail posé au sol la veille et modification de la longueur de la première paroi suite à une erreur de dimension.\r\npose des rails et des montants de la première partie de la seconde paroi en angle de 90° avec la première ainsi que la pose de la première plaque de placoplâtre.','Manque : pose de la porte et finition de la seconde paroi avec la pose de la seconde partie des rails au sol et la conception de l\'impost de la porte.',NULL,1,1,37,'2021-06-09 08:47:56','2021-06-09 16:02:47'),(28,'2021-06-02','2021-06-11 11:02:00','2021-06-24 11:02:00','00:30:00','sds65\r\n','',NULL,3,1,40,'2021-06-09 11:02:14','2021-09-28 16:30:16'),(29,'2021-06-10','2021-06-10 08:30:00','2021-06-10 11:00:00','02:30:00','Découpe de cornières pour renforcement meuble déchet cantine (détérioration avancé).\r\nMise en place de 5 cornières dans les angles intérieur du meuble.\r\nCollage au silicone des petits supports métalliques niveau plateau repas. ','Récupération des roulettes du meubles pour pose sur le nouveau de remplacement.',NULL,4,3,42,'2021-06-10 11:20:57','2021-06-10 13:18:40'),(30,'2021-06-10','2021-06-07 00:00:00','2021-06-07 00:00:00','02:30:00','Le meuble est en fort mauvais état : affaissement et écartement des parois.\r\nAprès délimitation d\'un périmètre de sécurité :\r\n- Renforcement de ces dernières par vissage d\'une équerre métallique (cornière galvanisée)sur la longueur totale du meuble, en pose par l\'intérieur.\r\n- Renforcement des côtés par vissage d\'équerres métalliques (cornière galvanisée) sur la totalité de la largeur en haut comme en bas\r\n- Nettoyage de la zone de travail','',NULL,4,3,41,'2021-06-10 11:22:07','2021-06-10 11:23:14'),(31,'2021-06-10','2021-06-10 08:30:00','2021-06-10 11:00:00','02:30:00','Afin de consolider la structure du meuble de désserte du restaurant nous avons posé dans les angles intérieurs 5 barres de cornière en métal galvanisé.\r\nChaque barre à pour rôle de solidifier et de permettre a la structure de maintenir sa fonction pour un laps de temps cependant limité. (Suite au constat de l\'état général de la structure, un changement de désserte est conseillé)','',NULL,4,3,44,'2021-06-10 11:24:24','2021-06-10 11:24:32'),(32,'2021-06-10','2021-06-07 15:20:00','2021-06-07 00:00:00','00:30:00','Après avoir retiré le précédent panneau, Prise de côtes et pose de chevilles à béton (8), fixation du tableau au mur.','',NULL,1,1,43,'2021-06-10 14:12:30','2021-06-10 14:12:59'),(33,'2021-06-10','2021-06-10 13:30:00','2021-06-10 14:00:00','00:30:00','Mise en place tableau atelier.\r\nTraçage et perçage de l\'emplacement puis fixation.','',NULL,1,1,39,'2021-06-10 14:15:07','2021-06-10 14:16:44'),(34,'2021-06-10','2021-06-10 08:30:00','2021-06-10 11:00:00','02:30:00','Mise en place de 5 cornier metallique,pour renforcement d\'un meuble de trie et posse plateau (cantine).','',NULL,4,3,45,'2021-06-10 14:19:43','2021-06-10 14:19:51'),(35,'2021-06-10','2021-06-10 13:30:00','2021-06-10 14:00:00','00:30:00','Enleve le tableau exsistante,musure le nouveau tableau,trace avec le crayon pour percer les trous et posser le tableau.\r\nTravail realise sans probleme.','',NULL,1,1,46,'2021-06-10 14:42:39','2021-06-10 14:42:51'),(36,'2021-06-10','2021-06-07 15:20:00','2021-06-07 00:00:00','00:30:00','Remplacement du tableau blanc du bâtiment 16 (côté soudeur) par un plus grand\r\n- Dépose de l\'ancien tableau\r\n- Traçage au mur des points de fixations du nouveau\r\n- Pose du nouveau tableau par chevilles et vis adaptées\r\n- Nettoyage du chantier','',NULL,1,1,38,'2021-06-10 14:48:19','2021-06-10 14:48:34'),(37,'2021-06-14','2021-06-14 09:30:00','2021-06-14 15:00:00','05:00:00','Réalisation d\'une cloison de distribution en plaques de plâtre sur ossature métallique. Cloison en L avec bloc porte.','Pose et réalisation du bloc porte.',NULL,1,1,47,'2021-06-14 14:20:08','2021-06-14 14:30:41'),(38,'2021-06-14','2021-06-07 15:20:00','2021-06-07 15:00:00','05:00:00','installation des cloisons en plaques de plâtre sur rails et montants, Pose de rails sur les dormants afin de créer une paroi de 175 cm, un angle de 90° ainsi qu\'une seconde paroi de 150cm au sol se terminant par un sabot afin de prévoir la pose d\'une porte.','installation de la porte et finition de la seconde paroi',NULL,1,1,48,'2021-06-14 14:29:01','2021-06-14 14:34:27'),(39,'2021-06-07','2021-06-07 08:05:00','2021-06-07 16:05:00','05:00:00','Nous (avec Thierry) avons faite le tracage ( sol et plafond ) pour poser le rail R48 en dimentions (175x2 en face et 156 sol,240plafond gauche)tous le 60cm,avec l\'aide de laser.\r\nApres le fixation de rail R48 avec le cheville a fraper (Diam 6) au sol et vis a bois plafond,ont a pose le montant M48 en double tous le 60cm et fixe entre avec les vises autoperceuse,tout le 50cm.\r\nMontant fixe ont a couper 1cm le PP,apres pose et fixe avec de vise de PP tout le 30cm.','Reste a poser une partie de PP,pour le raison des mesure de la bloque porte.\r\nTravail realise bien respectant les criteres demandé.\r\n\r\n\r\nPS : J\'espere que le description est bien detaille comme tu le veux,(ne regarde pas trop les fautes d\'orthographe). ',NULL,1,1,49,'2021-06-14 16:29:19','2021-06-14 18:58:51'),(40,'2021-06-14','2021-06-14 01:00:00','2021-06-14 17:00:00','00:10:00','pmop','',NULL,1,1,54,'2021-06-14 17:01:21','2021-09-09 15:00:58'),(41,'2021-06-15','2021-06-07 08:05:00','2021-06-07 13:00:00','05:00:00','Création d\'une poutre ainsi qu\'une retombée en ossature métallique avec pose de plaques de plâtre.\r\n(erreur de côte pour les dimensions, suite à confirmation par le responsable, côtes maintenues tel quelles)\r\nangle de 90°entre la poutre et la retombée respecté.','',NULL,1,1,53,'2021-06-15 10:58:33','2021-06-15 11:01:45'),(42,'2021-06-15','2021-06-15 08:30:00','2021-06-15 15:00:00','05:00:00','Réalisation d\'une retombée et d\'une cloison de séparation en plaque de plâtre sur ossature métallique.\r\nTraçage de l\'emplacement des rails(d\'abord au sol puis au plafond).\r\nMise en place de ces mêmes rails avec perfo et chevilles pour le sol et vis à placo pour le plafond.\r\nDécoupe des montants pour réalisation de la retombée de 20 cm et mise en place avec sertisseuse et visseuse.\r\nDécoupe des plaques de plâtres et mise en place.\r\nPositionnement un peu difficile car cabine pas tout à fait d\'équerre ainsi que la charpente pas très droite.\r\n','Fin de réalisation des cabines (plafond et finition).',NULL,1,1,52,'2021-06-15 15:31:32','2021-06-15 15:52:48'),(43,'2021-06-15','2021-06-15 08:30:00','2021-06-15 15:00:00','05:00:00','Le realisation de retombee et de la cloison de separation en PP sur ossature methalique et derule comme suivant:\r\nMarcage ou sol et sur le poutre plafond a l\'aide d\'un laser et fixe les Rail R48 en dimentions (sol 28.7cm et 175cm x2 \r\n au plafond).\r\nLes Rails pose,j\'ai pose les Montants sur le cloison en 230cm x2 et plafond 19.5 x6.\r\nles ossatures pose et sertie,j\'ai musures les dimentions pour poser les PP,un fois musures et couper je l\'ai fixe sur ossature methalique avec les vis a placo.\r\nFin du travail,ramasser les outils que j\'ai travaille et nettoyer le place du travail.\r\nLe travail est bien derule,sauf ( en peux de difficulte au debut.)','Realisation de la cabine en cour.',NULL,1,1,50,'2021-06-15 15:49:55','2021-06-16 12:14:53'),(44,'2021-06-15','2021-06-15 08:05:00','2021-06-15 16:00:00','05:00:00','Réalisation en plaques de plâtre d\'une retombée de 1m75 x 0m20 côtes finies et d\'une cloison de séparation, côté droit, de 0m30 x 2m30 côtes fines sur ossature métallique dans la cabine numéro 3.\r\n- Délimitation d\'une zone de sécurité sur toute la longueur des cabine\r\n- Pose de l\'ossature métallique de la retombée sous la panne en rails R48 et montants M48 de 1m7387 x 0m1877 \r\n- Pose de l\'ossature métallique de la cloison de droite en rails R48 et montants M48 de 0m287 x 2m3113\r\n- Pose de plaque de plâtre sur l\'ensemble de l\'ossature métallique maintenue par des vis à placo TF\r\n- Nettoyage du chantier et tri des déchets','',NULL,1,1,51,'2021-06-15 18:41:50','2021-06-15 18:42:07'),(45,'2021-06-16','2021-06-07 00:00:00','2021-06-07 13:00:00','04:00:00','Création d\'un faux plafond effectué à 240cm HSP, pose de rails sur le mur du fond de pièce et a son opposé, quatre rails positionnés à 60 cm du départ de droite en entrant, pose de la plaque de placoplatre (soucis lors de la pose car angle mal pris en côte, pose de map à prévoir avant la pose de bande).','',NULL,1,1,58,'2021-06-16 13:27:04','2021-06-16 13:28:02'),(46,'2021-06-16','2021-06-16 08:30:00','2021-06-16 14:00:00','05:00:00','Pose d\'un plafond en plaque de plâtre sur ossature métallique.\r\nTraçage emplacement des rails par rapport à la cote de référence (1m du sol).\r\nA l\'aide du niveau laser, report des cotes à 1.40 m par rapport au trait d\'emprunt.\r\nPose des rails et des montants puis fixation plaque de plâtre.\r\nPetit problème lors de la pose de la plaque, cabine pas tout à fait d\'équerre et casse de la plaque dans un coin( Map à prévoir).','finition',NULL,1,1,57,'2021-06-16 14:21:02','2021-06-16 14:32:32'),(47,'2021-06-16','2021-06-16 09:00:00','2021-06-16 14:00:00','05:00:00','Travail réalise bien sans souci particulier,sauf le montage de plaque que j\'avais besoin a l\'aide d\'un collègue.\r\nTravail réalise comme suivant: Installer le niveau a laser sur le pied a laser,et marque les traces avec le niveau de maçon pour le dimension demande,puis couper les rails en 175 x2 et fixe avec les vis a placo 35.Rails fixe,j\'ai mesure le dimension pour couper les montant,le dimension des montant sont 106.5 x4,montant pose et sertie.\r\nTous les ossature poser j\'ai mesure les cotes pour couper le PP,fois mesure et coupe le PP,je l\'ai fixe a l\'aide d\'un collègue avec les vis a PP 25.\r\nFin du travail,ramassage des outils et nettoyage de l\'espace travaille. ','',NULL,1,1,55,'2021-06-16 14:26:17','2021-06-16 14:29:35'),(48,'2021-06-16','2021-06-16 08:30:00','2021-06-16 13:30:00','04:00:00','Réalisation d\'un plafond en plaque de plâtre sur ossature métallique de 1m77 x 1m10 côtes finies\r\n- Balisage d\'une zone de sécurité\r\n- Pose de l\'ossature métallique avec rails R48 sur murs portants et montant M48\r\n- Contrôle des angles\r\n- Pose de la plaque de plâtre maintenue par vis Placo TF\r\n- Contrôle de la l\'horizontalité\r\n- Nettoyage et tri des déchets','',NULL,1,1,56,'2021-06-16 14:57:12','2021-06-16 15:00:13'),(49,'2021-06-17','2021-06-17 09:30:00','2021-06-17 11:30:00','02:00:00','Construction d\'une gaine technique en plaque de plâtre sur ossature métallique est déroule comme suivant:\r\nJ\'ai regarder le fiche d\'intervention donne,je l\'ai lis et âpres j\'ai préparer le outils que je besoin pour cette intervention,puis balisage de zone de travaille.\r\nJ\'ai fait les traces d\'emplacement pour fixe les rails en dimension donner par le formateur.\r\nUn fois trace,j\'ai couper les rails en 25.5cm x2 et 13.7 x2,un fois couper je l\'ai fixe avec les cheville a frapper en diam 6.Un fois poser les rails R48,j\'ai mesure les montante M48 en 240 x4,et deux montant je l\'ai fixe sur le placo avec le cheville à expansion en trois place (bas,milieu et haut). Les montants poser fixe et sertie j\'ai coupe le PP en dimension demande puis fixe sur les montant avec les vis a PP 25.\r\n\r\nPS: En raison d\'un urgence familial,je ne pouvais pas le terminer l\'intervention donner par le formateur.\r\n','Me reste pour poser l\'autre partie de PP.',NULL,1,1,59,'2021-06-17 09:11:50','2021-06-17 18:39:04'),(50,'2021-06-17','2021-06-17 09:00:00','2021-06-17 14:00:00','05:00:00','Construction d\'une gaine technique en plaque de plâtre sur ossature métallique.\r\nTraçage de l\'emplacement des rails pour des dimensions finies de 30 x 15 cm.\r\nFixation rails au sol avec chevilles à frapper et au plafond avec 2 chevilles à expansion.\r\nDécoupe des montants et fixation.\r\nDécoupe plaque de plâtre et fixation.\r\n\r\nRemarque: Mieux équilibrer la longueur des rails pour fixation plus simple.','Finition. ',NULL,1,1,61,'2021-06-17 14:10:10','2021-06-17 14:25:15'),(51,'2021-06-17','2021-06-07 09:00:00','2021-06-07 15:00:00','05:00:00','installation de la gaine complétée : \r\n1) Pose des morceaux de rails au sol et au plafond (utilisation de chevilles molies)\r\n2) Pose des 4 montants (utilisation de chevilles molies)\r\n3) Pose de 2 plaques de placoplâtre en position sur les montants\r\nRésultat final correct, petit dénivelé de l\'une des plaques de placoplâtre malgré le bon positionnement sur les rails, a corriger au map.','',NULL,1,1,62,'2021-06-17 14:19:07','2021-06-17 14:24:25'),(52,'2021-06-17','2021-06-17 11:00:00','2021-06-17 14:00:00','02:00:00','Construction d\'une gaine technique de 0m30 x 0m15x 2m40 en plaque de plâtre sur ossature métallique dans la cabine numéro 8.\r\n- Délimitation d\'une zone de sécurité\r\n- Pose de l\'ossature métallique de 0m15 x 2m40 contre le mur de droite en rails R48 et montants M48 \r\n- pose de l\'ossature métallique de 0m30 x 2m40 contre le mur du fond en rails R48 et montants M48\r\n- Les deux ossatures sont fixées au sol par des chevilles à frapper et aux murs ainsi qu\'au plafond par des chevilles métalliques à expansion plus vis type Molly de 4 x 35 mm et jointes ensembles par des vis autoperceuses\r\n- Pose d\'une plaque de plâtre de 0m15 x 2m40 fixée par vis Placo TF\r\n- Pose d\'une plaque de plâtre de 0m30 x 2m40 fixée par vis Placo TF\r\n- Nettoyage et tri des déchets','',NULL,1,1,60,'2021-06-17 20:10:58','2021-06-17 20:14:47'),(53,'2021-06-18','2021-06-18 08:30:00','2021-06-18 11:30:00','03:00:00','Réalisation en plaques de plâtre, d\'une retombée de 1m75 x 0m20 côtes finies sur ossature métallique dans la cabine numéro 2\r\n- Délimitation d\'une zone de sécurité sur toute la longueur des cabines\r\n- Pose d\'une panne de 1m75 perpendiculairement à la cloison de droite, maintenue par vissage et équerres métalliques afin de fixer la retombée\r\n- Pose de l\'ossature métallique de la retombée sous la panne en rails R48 et montants M48 de 1m737 x 0m187 \r\n- Pose de plaques de plâtre sur l\'ensemble de l\'ossature métallique, deux de 1m75 x 0m20 et une de 1m75 x 0m050, maintenue par des vis à placo TF\r\n- Nettoyage du chantier et tri des déchets\r\n\r\nNota bene : Un collègue ayant pris la cabine 3, je suis passé sur la 2','',NULL,1,1,64,'2021-06-18 13:59:50','2021-06-18 14:19:22'),(54,'2021-06-18','2021-06-18 09:00:00','2021-06-21 11:20:00','04:00:00','Apres le Briefing avec le demandeur,je lis le fiche et je préparer le matériel que j\'ai besoin pour finir le travail demander.\r\nLe travail et dérouler comme suivant: Avec un niveau a laser je tracer le (poutre) plafond le partie ou je doit poser le Rail R48 en dimension 175cm.Je couper de rail R48 X 2 en 175cm.\r\nUn fois le rail fixe sur le poutre avec le vis a bois,je préparer les montant en coupant en 18.7 x6 et je l\'ai sertie sur le rail,et a la fin j\'ai poser le Rail en bas et sertie sur les montant.\r\nTous les ossatures monter et fixe je couper le PP en dimension demander et fixe sur le ossature avec le vis a PP.\r\n','Travail de cabine en cour d’amélioration.',NULL,1,1,63,'2021-06-21 11:23:19','2021-06-21 13:10:16'),(55,'2021-06-21','2021-06-21 09:00:00','2021-06-21 13:00:00','04:00:00','Installation de la poutre en armature métallique et plaque de placoplâtre effectuée avec succès.\r\nAfin de profiter des chutes de placoplâtre les deux côtes ont été effectues avec une longueur de 168cm et un ajout d\'une longueur de 7cm Pour une longueur totale de 175 cm x 20cm de hauteur','',NULL,1,1,66,'2021-06-21 12:59:01','2021-06-21 13:00:42'),(56,'2021-06-21','2021-06-21 09:30:00','2021-06-21 13:30:00','04:00:00','Réalisation d\'une retombée de 20 cm et largeur 1.75 ml.\r\nDécoupe des rails et fixation, vis au plafond et sertissage avec montants pour le rail inférieur.\r\nPositionnement des montants et sertissage.\r\nDécoupe des plaques de plâtre et fixation. ','Finition.',NULL,1,1,65,'2021-06-21 13:30:13','2021-06-21 13:35:12'),(57,'2021-06-21','2021-06-22 08:30:00','2021-06-22 10:30:00','02:00:00','Apres la démonstration de formateur pour la préparation de l\'enduit,j\'ai commencer a préparer l\'enduit  pour faire les bandes.\r\nPremier temps j\'ai applique l\'enduit sur les joint et les angles suit j\'ai poser les bandes,un fois les bandes poses je re appliquer l\'enduit.\r\nLe lendemain j\'ai poncer les bandes travailler avec le papier de verre en 120 et aussi je paser l\'enduit de finition.\r\nTravail tres satisfaisant.','',NULL,1,1,67,'2021-06-22 15:28:41','2021-06-23 11:01:46'),(58,'2021-06-22','2021-06-22 09:00:00','2021-06-22 15:00:00','05:00:00','Après sécurisation de la zone de travail, réalisation de bandes de calicot : plate, rentrante, sortante.\r\nPréparation de l\'enduit et dépoussiérage des parois\r\n- Pour la plate et la rentrante (cueillie)\r\n  - garnissage du joint\r\n  - pose de la bande\r\n  - collage, serrage et recouvrement de cette dernière\r\n- Pour la sortante (saillie)\r\n  - application d\'enduit sur chaque côté de l\'angle\r\n  - pose de la bande armée\r\n  - serrage et recouvrement de cette dernière\r\nAprès séchage, ponçage léger puis application d\'une seconde passe puis couche de finition couche de finition\r\n- Recouvrement des têtes de vis en deux passes\r\nNettoyage du chantier et tri des déchets','',NULL,1,1,68,'2021-06-23 11:07:54','2021-06-23 22:25:43'),(59,'2021-06-23','2021-06-23 08:00:00','2021-06-23 13:00:00','05:00:00','Pôse de 5 bandes de plaques de platre (3 entrantes, une sortante, une plate) difficulté posée sur l\'angle sortant à cause d\'un écart de 4 mm arrangé en premier lieu a l\'enduit, puis, suite au conseil du formateur, l\'enduit à été remplacé par du map.\r\nLes 5 bandes ont été posés puis recouvertes de deux couches d\'enduit et sont en attente de séchage pour ponçage.\r\nles têtes de vis apparentes ont été pour leur part enduite et sont en attente de séchage pour ponçage.','Ponçage pour finition',NULL,1,1,70,'2021-06-23 12:35:02','2021-06-23 12:45:41'),(60,'2021-06-23','2021-06-23 08:20:00','2021-06-23 13:00:00','05:00:00','Pose de bandes à plaques de plâtre.\r\nApplication d\'enduit et positionnement de la bande puis serrage de celle-ci.\r\nApplication de map pour récupération des défauts.\r\nPonçage et application d\'une 2eme passe d\'enduit.  ','Ponçage de finition.',NULL,2,1,69,'2021-06-23 12:37:38','2021-06-23 12:43:17'),(61,'2021-06-24','2021-06-24 10:00:00','2021-06-24 15:00:00','04:00:00','Pose du plafond technique réalisée avec succès a 240cm du sol, pose d\'une cornière sur trois faces (quatrième en attente), découpe de deux rails porteurs de 175 fixés à l\'aide de deux suspentes à coulisses, pose de 3 entretoises centrales et de six entretoises coupés latérales et  finalement pose des dalles de plafond acoustique dans les espaces prévus.','',NULL,1,1,74,'2021-06-24 16:16:33','2021-06-24 16:25:37'),(62,'2021-06-24','2021-06-24 11:00:00','2021-06-14 16:10:00','05:00:00','Réalisation d\'un plafond technique en dalle de 60 x 60 cm.\r\nTraçage de l\'emplacement des cornières à 2.40 m du sol même niveau que le plafond en plaques de plâtre.\r\nFixation des cornières de rive avec chevilles placo et vis.\r\nFixation des suspentes et mise en place des porteurs.\r\nDécoupe des entretoises et mise en place.\r\nDécoupe des dalles de plafond technique et mise en place.','Nettoyage.',NULL,1,1,73,'2021-06-24 16:18:33','2021-06-24 16:34:51'),(63,'2021-06-24','2021-06-24 13:30:00','2021-06-25 11:00:00','05:00:00','Apres briefing avec le formateur et aussi apprentissage de technique  comment poser et installer un plafond en dalles de 60x60 cm.\r\nAvant commencer le travail,j\'ai sécurise la zone du travail avec ruban de signalisation.\r\nA l\'aide du laser j\'ai commence à tracer  l\'emplacement pour poser les corner de rive.\r\nApres le traçage j\'ai fixe les corniers avec le vise a bois.\r\nPuis j\'ai pris une poutre a fixe avec les équerre  pour que je puis installer les suspende pour fixer les porteurs.\r\nTous l\'ossature métallique installer et fixe en dimension demander par le demandeur,je couper les dalles avec le cutter et poser sans trace.\r\nA la fin du travail j\'ai commencer a collecte et netoyer les outils utiliser pour le chantier,puis nettoyer lieu de travail.','',NULL,2,1,71,'2021-06-28 11:00:07','2021-06-28 11:00:40'),(64,'2021-06-22','2021-06-22 09:00:00','2021-06-22 15:30:00','05:00:00','Réalisation d\'un plafond technique en dalles à bords francs de 60x60 cm de l\'entrée de la cabine jusqu\'à la retombé, soit 1m75 x 1m11 à 2m40 du sol afin de respecter la taille minimale du plénum.\r\n- Mise en place de la zone de sécurité\r\n- Pose d\'une panne de bois de 1m30 x 0m15 x 0m075 au dessus de l\'ossature bois de 1m75 maintenant la retombée, à 0m80 du mur droit, maintenue par équerre métallique et vissage par vis à bois\r\n- Réalisation du calepinage\r\n- Pose de trois cornières de rives :\r\n  - 1 fixée sur le mur droit en OSB par vis à placo TF\r\n  - 2 fixées sur la retombée en BA13 par cheville à expansion plus vis\r\n- Pose de deux demi-colliers vissés sur la panne par vis à bois\r\n- Pose de deux tiges filetées de 0m20 dans les demi-colliers maintenues par écrou et contre-écrou de 10mm\r\n- Pose de deux coulisseaux, un sur chaque tige filetée, maintenus par écrou et contre-écrou de 10mm\r\n- Pose de deux profilés porteurs en T de 24mm (en conservant les lumière-feux) par insertion dans les coulisseaux et reposant sur la cornière de rive du mur de droite\r\n- Pose de trois entretoises de 0m60 et six de 0m245\r\n- Lavage des mains\r\n- Découpes et pose des dalles\r\n  - 2 de 0m60 x 0m60\r\n  - 4 de 0m60 x 0m245\r\n  - 2 de 0m60 x 0m275\r\n  - 4 de 0m275 x 0m245\r\n- Nettoyage des parties visibles sur cornières, porteurs et entretoises\r\n- Nettoyage du chantier et tri des déchets\r\n','',NULL,1,1,72,'2021-06-28 15:08:02','2021-06-28 15:25:53'),(65,'2021-06-29','2021-06-29 08:30:00','2021-06-29 16:30:00','05:00:00','Traçage et prise de mesure pour implantation.\r\nUtilisation d\'un rail comme support de niveau et fixation avec vis à placo.\r\nRayure du placo pour meilleur adhérence de la colle (D2).\r\nApplication de la colle au mur à l\'aide d\'un platoir cranté (une passe coté lisse puis une seconde coté cranté (U6).\r\nPose des carreaux avec croisillons.\r\nPose des joints.','',NULL,2,1,78,'2021-06-29 15:02:28','2021-06-30 10:03:50'),(66,'2021-06-29','2021-06-29 09:00:00','2021-06-29 14:00:00','05:00:00','Travail réalisé come suivant:\r\nJ\'ai récupéré des fiches techniques comment poser du carrelage par le formateur,apres suit a compréhension des techniques,j\'ai préparer les outils pour commence le travail en bonne condition.\r\n1) J\'ai pris un ancien rail (pour un niveaux de base) et je le coupé en dimension demander.Puis avec un mettre j\'ai tracé l\'axe et l\'hauteur ou je doit commence à poser.\r\n2) J\'ai pris l\'adhesif amélioré D2,avec un spatule crantees U6 j\'ai posé l\'adhesif sur le plan de travail.\r\n3) Apres l\'adhesif posé,je commence a poser les carreaux de faïences et poser des crosillion joint 2mm entré chaque carreaux.\r\n4) Les carreaux de faïence poser,j\'ai préparer du mortier joint couleur blanc,et appliqué sur les joint des carreaux.\r\n5) Tous les étapes finies,j\'ai nettoyé les matériels de travail utilisé et aussi les carreaux de faïence.A la fin je nettoyé le lieux de travail comme chaque fin l\'intervention.\r\n\r\nPs : J\'espère que travail réalisé,va être aimé par le demander,car c\'est un première pour moi.\r\n','',NULL,2,1,76,'2021-06-29 15:46:31','2021-06-29 19:39:21'),(67,'2021-06-29','2021-06-29 08:00:00','2021-06-29 16:30:00','05:00:00','Pose de faïence exécutée avec succès.\r\n\r\n1 : Traçage des côtes sur le mur avec un départ à -35cm du mètre étalon\r\n2 : Fixation d\'un rail sur le mur pour servir de niveau de base\r\n3 : Dépôt de la colle de type D2 (résistante à l\'eau) sur le mur, étage par étage, puis dépôt des dalles de mosaïque espacées par des croisillons de 2mm\r\n4 : Après séchage de la colle, insertion grâce à la palette à joints du mortier à joints entre les dalles et sur le contour de celles-ci (finition au doigt et contour plat pour dépôt de silicone ultérieur).','',NULL,2,1,79,'2021-06-30 10:14:11','2021-06-30 10:15:37'),(68,'2021-06-30','2021-06-30 08:30:00','2021-06-30 16:30:00','05:00:00','Calepinage sur papier pour carreaux 30x30 cm.\r\nTraçage de la zone au sol et vérification de l\'équerrage et de la planéité.\r\nPréparation et nettoyage de la zone.\r\nPose à blanc des carreaux et découpe de ceux-ci.\r\nPréparation colle et application puis pose des carreaux, utilisation de croisillons de 4 mm.\r\nAprès séchage, découpe des plinthes et collage de celles-ci.\r\nRéalisation des joints plinthes et carreaux. \r\nNettoyage.','',NULL,2,1,83,'2021-06-30 15:44:21','2021-07-01 14:56:08'),(69,'2021-06-30','2021-06-30 12:30:00','2021-06-30 16:00:00','03:30:00','Travail déroulé comme suivant:\r\nBalisage de zone avant commencer le travail,puis gratter avec un spatule et balayé le sol pour avoir un sol propres et sans bosse.\r\nL\'espace du travail propre,j\'ai préparé mortier-colle normal C1 pour poser sur sol avant pose les carreaux a l\'aide d\'un malaxeur.\r\nUn fois le mortier colle prépare j\'ai commencer a pose la colle avec un platoir puis avec la spatule crantées U6.\r\nLe colle posé sur l\'espace de travail,j\'ai commencer a poser les carreaux en posent des croisillon en 4mm entre chaque carreaux.\r\nJ\'ai eux la coupe de carreaux a faire,et je l\'ai fait a l\'aide de carrelette et aussi avec un disqueuse a eaux carrelage.\r\nUn fois les carreaux poser j\'ai commencer de poser les plinthes en appliquant le même procedé de travail que la pose des carreaux.','',NULL,2,1,81,'2021-06-30 19:10:59','2021-07-01 12:39:02'),(70,'2021-06-30','2021-06-30 09:00:00','2021-06-30 15:30:00','05:00:00','Pose de carrelage au sol (par pose au carrément) dans l\'axe de la faïence murale et de plinthes à droite de la cabine 5 sur une surface de 1.56m2\r\n- Balisage de la zone de sécurité\r\n- Nettoyage dépoussiérage du sol\r\n- Vérification de la planéité\r\n- Réalisation d\'un calepinage après contrôle des angles\r\n- Réalisation des découpes\r\n- Préparation du mortier-colle\r\n- Encollage du sol et étirage au peigne de 6mm\r\n- Pose du carrelage en simple encollage\r\n- Contrôle de la planéité\r\n- Nettoyage des carreaux de céramique\r\n- Pose des plinthes dans l\'axe du carrelage\r\n- Jointoiement après séchage de la colle de pose du carrelage et des plinthes\r\n- Nettoyage de l\'ensemble posé\r\n- Nettoyage et tri des déchets\r\n\r\n','Nettoyage du carrelage et des plinthes des traces de jointoiement après séchage complet',NULL,1,1,82,'2021-06-30 23:07:45','2021-07-01 22:33:56'),(71,'2021-07-01','2021-07-01 08:30:00','2021-07-01 16:30:00','05:00:00','Pose de carrelage réalisée fond droit de cabine.\r\nPrise des côtes, vérification des sols (Planéité et stabilité impossible, tentative de rattrapage avec la colle) et des angles.\r\nPremier calepinage en pose sans colle afin d\'assurer une bonne découpe de chaque carreau de carrelage.\r\nÉlaboration et pose de la colle de type C1, pose des carreau avec croisillons de 4mm avec départ dans l\'angle, vérification des niveaux.\r\nAprès séchage, découpe et pose des plaintes en carrelage avec colle de type D2.\r\nAprès séchage, pose des joints larges (couleur beige), finition des joints avec chiffon humide et éponge.\r\n\r\n\r\nAprès séchage total, constat d\'une dalle de carrelage décollée, prévoir fiche d\'intervention pour réparation.\r\n ','',NULL,2,1,84,'2021-07-02 10:35:37','2021-07-02 10:45:57'),(72,'2021-06-28','2021-06-28 09:00:00','2021-06-28 15:30:00','05:00:00','Pose d\'un panneau de faïence sur le mur du fond de la cabine 5 de 0m79 x 0m80 avec un retour sur la colonne à droite de 0m20 x 0m80\r\n- Balisage de la zone de sécurité\r\n- Nettoyage et dépoussiérage du mur\r\n- Contrôle des angles et de la planéité\r\n- Réalisation d\'un calepinage\r\n- Préparation du support pour l\'adhérence (griffures en quadrillage au cutter)\r\n- réalisation d\'un support de pose à 0m65 du sol\r\n- Préparation du mortier colle\r\n- Application de la colle au mur avec passage au peigne de 6mm\r\n- Pose de la faïence après lavage de cette dernière\r\n- Contrôle de la planéité et des niveaux\r\n- Réalisation des joints de 2mm après séchage de la colle de pose\r\n- Nettoyage et tri des déchets ','',NULL,1,1,77,'2021-07-02 18:16:28','2021-07-02 19:01:34'),(73,'2021-07-05','2021-07-05 09:45:00','2021-07-05 14:30:00','04:40:00','Calepinage des dalles PVC.\r\nDécoupe et vérification implantation.\r\nNettoyage de la surface de pose.\r\nApplication colle et dalles.\r\nSerrage des dalles.\r\nNettoyage surplus de colle.','',NULL,2,1,88,'2021-07-05 15:19:38','2021-07-05 15:21:58'),(74,'2021-07-05','2021-07-05 13:30:00','2021-07-05 15:30:00','02:00:00','Pose de dalles PVC de 0m33 x 0m33 sur le fond de la cabine à gauche dans l\'alignement du carrelage\r\n- Balisage de la zone de sécurité\r\n- Nettoyage et préparation du sol\r\n- Contrôle des angles\r\n- Réalisation d\'un calepinage\r\n- Traçage de l\'implantation\r\n- Traçage du tapis\r\n- Découpe des dalles de bordure\r\n- Encollage du sol à la spatule crantée type A2\r\n- Pose des dalles PVC après gommage de la colle\r\n- Marouflage de l\'ensemble du revêtement\r\n- Nettoyage des éventuelles traces de colle\r\n-Nettoyage du chantier et tri des déchets\r\n\r\n','',NULL,1,1,87,'2021-07-05 20:39:16','2021-07-05 20:57:47'),(75,'2021-07-06','2021-07-06 09:00:00','2021-07-06 14:00:00','05:00:00','Mise en peinture d\'impression de l\'ensemble des parois en plaque de plâtre de la cabine n°5\r\n- Balisage de la zone de travail\r\n- Epoussetage et nettoyage des murs\r\n- Dépoussiérage de la cabine\r\n\r\nAprès la mise en place de la bâche pour la protection du sol\r\n- Rechampissage des angles\r\n- Mise en peinture des parois en plaque de plâtre avec une couche d\'impression \r\n - impression, peinture impression acrylique Trimetal Rollprim \r\n- Nettoyage des éventuelles traces de peintures sur les plinthes, la paroi en OSB ou la faïence murale\r\n- Nettoyage des outils\r\n- Nettoyage de la zone de travail\r\n','Il reste à faire la couche intermédiaire et celle de finition avec de la peinture plafond acrylique mat Trimetal Rollatex mat',NULL,1,1,91,'2021-07-05 21:17:00','2021-07-13 20:32:23'),(76,'2021-07-07','2021-07-07 08:30:00','2021-07-07 15:30:00','05:00:00','Préparation par ponçage et nettoyage des surfaces à peindre, préparation du matériel (brosse, pinceau, rouleau, seau, peinture, etc...)\r\n\r\nMise en peinture en commençant par les bordures et les angles a la brosse, puis passage au rouleau sur toutes les surfaces (première expérience, j\'ai moi même commencé par l\'intérieur des murs, après une remarque et réflexion faite j\'aurais du commencer par faire toutes les bordures et ensuite par le plafond).','Manque du rouleau à peinture dans les outils magasin.',NULL,2,1,93,'2021-07-07 15:19:32','2021-07-07 15:25:03'),(77,'2021-07-06','2021-07-06 08:30:00','2021-07-06 10:30:00','02:00:00','Pose découpe et collage d\'environ 10 dalles de PVC réussie, \r\n\r\n1) Calepinage au sol sans colle afin de vérifier les angles et préparer les différentes coupes.\r\n2) Découpe des dalles selon les besoins et vérification au sol sans colle.\r\n3) Préparation de la colle (Dans ce cas nous avons utilisé de la colle à toile de verre)\r\n4) Encollage grâce à une spatule peigne de 2mm\r\n5) Collage des dalles de PVC\r\n6) Nettoyage','Je ne suis pas sûr de l’appellation pour la spatule a maroufler..',NULL,2,1,94,'2021-07-07 15:30:28','2021-07-07 15:37:02'),(78,'2021-07-08','2021-07-08 08:30:00','2021-07-08 12:00:00','05:00:00','Pose de protections au sol, délimitation de la zone de travail.\r\nVérification surface à peindre.\r\nPréparation de la peinture (malaxage).\r\nApplication peinture (impression) dans les angles avec la brosse à réchampir.\r\nApplication peinture (impression) sur le reste des parois avec manchon à peinture.\r\nNettoyage.','',NULL,2,1,92,'2021-07-08 11:07:22','2021-07-08 11:16:54'),(79,'2021-07-07','2021-07-07 08:30:00','2021-07-07 16:30:00','05:00:00','Premier ponçage du tableau.\r\nApplication couche enduit.\r\nPonçage enduit et application d\'une seconde couche d\'enduit (rattrapage défaut de planéité).\r\nPonçage final et application de 2 couches de peinture.\r\nNettoyage.','Contact demandeur pour restitution.',NULL,4,3,96,'2021-07-08 11:25:17','2021-07-08 11:33:22'),(80,'2021-07-07','2021-07-07 09:00:00','2021-07-08 09:00:00','05:00:00','Ratissage à l\'enduit et mise en peinture d\'une maquette pédagogique pour la formation TEAB.\r\nLa maquette étant dans un mauvaise état avec des réparations sommaires et des traits de marqueur, il a fallu :\r\n- Enlever toutes les traces de scotch\r\n- Gratter le surplus de mortier adhésif pour plaque de plâtre\r\n- Eliminer les résidus de bois dus aux différents perçages\r\n- Poncer l\'ensemble de la maquette\r\n- Dépoussiérer l\'ensemble\r\n- Reboucher de toutes les imperfections à l\'enduit\r\n- Poncer\r\n- Passer une seconde couche d\'enduit\r\n- Poncer \r\n- Dépoussiérer\r\n- Laver à l\'eau claire\r\n- Passer une première couche de peinture\r\n- Poncer légèrement\r\n- Passer une seconde couche de peinture\r\n- Poncer légèrement\r\n- Passer une troisième couche de peinture car les traits de marqueur étaient encore visibles\r\n- Contacter les stagiaires de la formation TEAB, qui ont validé le travail effectué\r\n','',NULL,1,1,95,'2021-07-08 19:51:13','2021-07-08 20:26:21'),(81,'2021-07-08','2021-07-08 09:00:00','2021-07-08 16:30:00','05:00:00','Mise en peinture d\'impression du plafond en plaque de plâtre de la cabine n°8\r\n\r\n- Balisage de la zone de travail\r\n- Epoussetage et nettoyage du plafond\r\n- Dépoussiérage de la cabine\r\n\r\nAprès la mise en place de la bâche pour la protection du sol\r\n- Rechampissage des angles\r\n- Mise en peinture du plafond en plaque de plâtre en trois couches impression, intermédiaire et finition \r\n  - impression, peinture impression acrylique Trimetal Rollprim \r\n  - intermédiaire et finition, peinture plafond acrylique mat Trimetal Rollatex mat\r\n- Nettoyage des éventuelles traces de peintures sur les murs, plinthes ou la faïence murale\r\n- Nettoyage des outils\r\n','',NULL,1,1,100,'2021-07-08 20:50:59','2021-07-09 14:21:58'),(82,'2021-07-08','2021-07-08 14:00:00','2021-07-08 16:00:00','02:00:00','Mise en place protection sol et balisage.\r\nApplication peinture au plafond avec manchon.\r\nNettoyage.','',NULL,2,1,101,'2021-07-09 11:35:01','2021-07-09 11:35:51'),(83,'2021-07-12','2021-07-12 11:00:00','2021-07-12 15:00:00','02:30:00','Peinture posée sur plafond de la cabine : \r\n1) Préparation des outils (Rouleau, brosse, seau, etc...) et protection du sol et des alentours de la zone à peindre.\r\n2) Après mélange de la peinture, pose du réchampi sur tout les côtés du plafond (Dans mon cas, cette première couche pouvais être trop mince sur certains endroits, veiller à être généreux...).\r\n3) Passage du rouleau de manière généreuse (grasse, comme le dirais un certain Franck... ;) en passant le plus proche du mur possible pour couvrir le rechampi (erreur de type de peinture dans ce cas car j\'ai utilisé de la satinée au lieu de la peinture mat).\r\n4) Nettoyage des outils, rangement du matériel, protection de la zone.','',NULL,2,1,102,'2021-07-12 16:20:06','2021-07-12 16:22:40'),(84,'2021-07-13','2021-07-13 11:00:00','2021-07-13 12:00:00','01:00:00','Pose du cadre effectuée : \r\n\r\n1) Prise des côtes à l\'aide du niveau laser, du mètre ruban et du niveau à bulle.\r\n2) Découpe des baguettes à l\'aide de la scie à onglet \r\n3) Après vérification au sol, fixation sur le mur à la colle.','',NULL,2,1,111,'2021-07-13 13:23:27','2021-07-13 13:25:11'),(85,'2021-07-13','2021-07-13 08:30:00','2021-07-13 12:00:00','03:30:00','Mise en place protection pour le sol.\r\nDécoupe de la toile de verre.\r\nApplication colle.\r\nPose de la toile de verre et découpe pour les angles.\r\nNettoyage surplus de colle.','',NULL,2,1,106,'2021-07-13 13:25:29','2021-07-13 13:27:56'),(86,'2021-07-12','2021-07-12 16:00:00','2021-07-12 16:30:00','00:30:00','Avant commencer de posser les dalles en PVC,j\'ai nettoyer le sol puis je pris le colle a dalle pour aplique sur le plan de travaille.\r\nApres le colle apliquer j\'ai posser les dalles l\'un apres l\'autre,puis je fais des coupes et posser.','',NULL,2,1,86,'2021-07-13 13:35:57','2021-07-13 13:37:12'),(87,'2021-07-13','2021-07-13 08:30:00','2021-07-13 10:00:00','01:30:00','Pose de toile de verre effectuée : \r\n\r\n1) Prise des côtes et mesures\r\n2) Découpe du les de toile de verre à la dimension du mur + 10 cm\r\n3) encollage au pinceau puis au rouleau sur les deux premiers angles\r\n4) dépose du les, marouflage et découpe à 2cm de l\'angle sortant\r\n5) Dépose du les en superposition de la première découpe (env 2cm) et marouflage sur le second angle puis découpe\r\n6) encollage des dernières parties à l\'aide du niveau laser \r\n7) dépose des deux les, marouflage et découpe\r\n8) finition à l\'aide d\'une éponge humide\r\n','',NULL,2,1,107,'2021-07-13 13:38:21','2021-07-13 13:43:45'),(88,'2021-07-12','2021-07-12 13:30:00','2021-07-12 14:00:00','00:30:00','Apres la peinture d\'impression applique et séché sur tout l\'espace de travaille,j\'ai recommencer a rechampir avec le brosse a rechampir le peinture MAT sur plafond,puis applique la peinture MAT sur le tout surface de plafond avec le manchon polyamide.Apres le travaille j\'ai nettoyer le brosse et aussi le manchon polyamide au fontaine de nettoyage.','',NULL,2,1,99,'2021-07-13 13:49:43','2021-07-13 14:02:46'),(89,'2021-07-13','2021-07-13 12:00:00','2021-07-13 13:45:00','00:30:00','Prise de mesure et traçage.\r\nDécoupe baguette avec angle à 45°pour formation cadre.\r\nCollage.','',NULL,2,1,110,'2021-07-13 13:58:44','2021-07-13 14:02:12'),(90,'2021-07-12','2021-07-13 09:30:00','2021-07-15 15:00:00','05:00:00','Je prépare le matériel de travaille pour faire la peinture (peinture,colorant,brosse a rechampir,rouleau a peinture,seau pour préparer la peinture colorie).\r\nApres de vérification de l\'espace de travaille s\'il aurais besoin de ponçage a refaire,j\'ai commencer a faire le rechampir avec le brosse a rechampir,puis avec le rouleau je fini la peinture.\r\nUn fois la premier couche de la peinture faite,le lendemain j\'ai recommencer la deuxième couche de la totalité de la cabine.\r\nun fois peinture finir j\'ai nettoyer le brosse aussi le rouleau a lavage fontaine,puis je nettoyer l\'espace de travail.','',NULL,2,1,116,'2021-07-13 14:04:42','2021-07-16 09:51:46'),(91,'2021-07-12','2021-07-12 10:00:00','2021-07-12 11:30:00','01:30:00','Apres le briefing du jour avec le demandeur,je pris le document pour faire un couche peinture d\'impression l\'ensemble des plaque de plâtres.\r\nApres le vérification de plaques s\'il aurais des retouche a faire,j\'ai commencer a rechampir avec le brosse a rechampir,puis j\'ai appliquer sur l’ensemble des PP la peinture d\'impression avec le manchon polyamide.\r\nApres l\'application de la peintures j\'ai nettoyer le brosse et manchon polyamide au fontaine de nettoyage.\r\n','',NULL,2,1,90,'2021-07-13 14:25:55','2021-07-13 14:28:33'),(92,'2021-07-13','2021-07-13 10:00:00','2021-07-13 10:30:00','00:30:00','Suite l’amélioration des revêtements intérieurs,c\'est la pose de toile de verre.\r\nLa pose c\'est dérouler comme suivant: J\'ai pris en magasin un brosse plat et aussi manchon polyamide pour applique le colle de toile de verre sur l\'endroit a poser.Puis j\'ai couper le toile de verre en dimension 240cm sur le table a tapisser.\r\nJ\'ai commencer a pose sur l\'angle sortant pour que je puis faire un double coupe.\r\nA l\'aide d\'un grand niveaux je fait la premier coupe,puis je poser par déçu l\'autre partie pour faire la coupe double.La coupe double faite,a l\'aide d\'un lase je commencer la suite de la pose pour avoir le mémé dimension de toile de verre.  \r\nApres la pose de toile de verre faite a l\'aide d\'un éponge j\'ai nettoyer le colle et l\'espace de traville.\r\n','',NULL,2,1,104,'2021-07-13 14:41:23','2021-07-13 14:47:02'),(93,'2021-07-13','2021-07-13 15:00:00','2021-07-13 15:20:00','00:20:00','Confection d\'un cadre avec des baguettes de champlat de 0m30 x0m30 sur le mur de gauche ; à la hauteur hauteur de 1m05 à 1m35 du sol et à 0m35 à 0m65 de l\'angle du mur.\r\n- Balisage de la zone de travail\r\n- Marquage des côtes sur le mur\r\n- Découpe de la baguette de champlat en quatre sections de 0m30 x 0m30\r\n- Découpe des bouts de ces derniers à angle droit de 90° avec une scie à onglet\r\n- Ebavurage des coupes au papier de verre fin\r\n- Vérification des côtes finies\r\n- Test à blanc\r\n- Pose sur le mur par collage au mastic colle à l\'emplacement prévu\r\n- Nettoyage et tri des déchets','',NULL,1,1,109,'2021-07-13 19:59:44','2021-07-13 20:20:51'),(94,'2021-07-13','2021-07-13 13:40:00','2021-07-13 14:10:00','00:30:00','Pose de toile de verre sur le mur du fond. Cette dernière doit couvrir la colonne de droite ainsi qu\'une partie à droite du mur du fond.\r\n- Balisage de la zone de travail\r\n- Ponçage léger pour enlever les éventuels résidus\r\n- Epoussetage du mur\r\n- Prise des côtes du lieu de pose et contrôle des angles\r\n- Découpe d\'un lé de 2m42 x 1m00\r\n- Encollage du mur à la colle à toile de verre de la largeur du lé plus un petit débord\r\n- Pose de la toile de verre en commençant par le côté droit de la colonne avec une coupe dans les angles\r\n  - en laissant un surplus de 5cm en haut et en bas\r\n  - en laissant un léger surplus à chaque angle afin de pouvoir réaliser une coupe de raccord\r\n- Marouflage de chaque élément de cette dernière en partant du centre vers les extrémités\r\n- Découpe des angles\r\n- Découpe de la toile de verre sur le pourtour de la faïence murale\r\n- Découpe du surplus au ras de la plinthe et du plafond\r\n- Nettoyage à l\'éponge humide pour éliminer les éventuels traces ou surplus de colle\r\n  - dans les angles\r\n  - au plafond\r\n  - sur la plinthe\r\n  - sur la faïence murale\r\n  - sur le mur à la bordure gauche du lé\r\n- Nettoyage de la zone de travail et tri des déchets\r\n','',NULL,2,1,105,'2021-07-13 20:35:38','2021-07-13 22:02:02'),(95,'2021-07-13','2021-07-13 15:00:00','2021-07-15 16:30:00','05:00:00','Mise en peinture des cloisons internes de la cabine n°8 en respectant une couleur différente sur la toile de verre de celle appliquée sur les parties lisse.\r\n- Balisage de la zone de travail\r\n- Ponçage léger des parties lisses pour ôter les résidus éventuels\r\n- Epoussetage des murs\r\n- Nettoyage de la zone de travail et pose d\'une bâche de protection sur le sol\r\n- Mise en peinture des parties lisses en deux couches, intermédiaire et finition avec de la peinture peinture acrylique Trimetal Rollatex satin blanche\r\n- Mise en peinture de la toile de verre en deux couches, intermédiaire et finition avec de la peinture acrylique Trimetal Rollatex satin grise\r\n- Nettoyage des éventuelles traces de peintures sur les murs, plinthes, plafond ou la faïence murale\r\n- Nettoyage des outils\r\n- Nettoyage des sols\r\n\r\n','',NULL,2,1,117,'2021-07-13 22:05:43','2021-07-16 13:29:22'),(96,'2021-07-15','2021-07-15 09:00:00','2021-07-15 14:00:00','04:00:00','Mise en peinture des boiseries de la cabine n°8, plinthes et cadre en champlat\r\n- Balisage de la zone de travail\r\n- Ponçage léger des boiseries pour ôter les éventuels résidus \r\n- Epoussetage de ces dernières\r\n- Nettoyage de la zone de travail et pose d\'une bâche de protection sur le sol\r\n- Mise en peinture des boiseries en deux couches, intermédiaire et finition avec de la peinture acrylique Trimetal Rollatex satin grise\r\n- Nettoyage des éventuelles traces de peintures sur les murs et au sol\r\n- Nettoyage des outils\r\n- Nettoyage des sols','',NULL,2,1,113,'2021-07-14 21:27:48','2021-07-16 13:34:22'),(97,'2021-07-15','2021-07-15 08:30:00','2021-07-15 16:00:00','05:00:00','Mise en place protection au sol.\r\nUtilisation brosse à réchampir pour application peinture dans les angles.\r\nApplication peinture avec manchon pour le reste de la surface à peindre.\r\nBalisage et nettoyage sol et outillage.','',NULL,2,1,118,'2021-07-15 16:03:12','2021-07-15 16:06:07'),(98,'2021-07-15','2021-07-15 13:15:00','2021-07-15 14:25:00','01:10:00','Application peinture sur les boiseries de la cabine avec brosse à rechampir.\r\n','',NULL,2,1,114,'2021-07-15 16:11:49','2021-07-15 16:12:28'),(99,'2021-07-15','2021-07-15 10:00:00','2021-07-15 11:00:00','01:00:00','En faisant le peinture de la cabine je fait le mémé temps le mise en peinture des boiseries de la cabine.\r\nAvec un brosse a rechampir je fait la peinture des plinthes aussi le champlat.\r\nL’opération et déroule en deux fois. ','',NULL,2,1,112,'2021-07-16 10:00:53','2021-07-16 10:01:40'),(100,'2021-07-13','2021-07-13 13:30:00','2021-07-13 15:30:00','02:00:00','Apres le prise de la fiche par la demandeur,je fait la mesure et traçage de l\'emplacement des baguettes.Suite j\'ai couper les baguettes avec scie a onglet 45°.\r\nApres le coupes,je mis le colle et poser.\r\nEn posant en mauvais endroit,jetait oblige de refaire le support (enduit et peinture d\'acrocche)\r\nPuis refaire la pose des baguettes.','',NULL,2,1,108,'2021-07-16 10:13:14','2021-07-16 10:13:58'),(101,'2021-09-09','2021-09-08 09:00:00','2021-09-09 15:03:00','05:00:00','Pose de carreaux de faïence murale avec joint de finition','',NULL,1,1,126,'2021-09-08 11:37:21','2021-09-08 11:50:26'),(102,'2021-09-08','2021-09-08 08:25:00','2021-09-08 15:25:00','01:10:00','Remplacement moquette','',NULL,1,3,124,'2021-09-08 15:28:05','2021-09-08 15:29:10'),(103,'2021-09-08','2021-09-08 08:54:00','2021-09-08 15:55:00','02:00:00','Moquette','Nettoyage Karcher',NULL,1,3,127,'2021-09-08 15:59:56','2021-09-08 16:04:06'),(104,'2021-09-09','2021-09-08 14:22:00','2021-09-09 14:22:00','02:00:00','Pose de faïence avec joint ciment','Non',NULL,2,1,128,'2021-09-09 14:27:21','2021-09-09 14:27:54'),(105,'2021-09-06','2021-09-06 13:00:00','2021-09-06 15:59:00','02:00:00','Pose d\'un sol souple en dalles pvc','Attendre le gommage de la colle pour la pose du sol souple.',NULL,1,1,254,'2021-09-13 08:52:34','2021-09-13 08:53:57'),(106,'2021-09-08','2021-09-08 10:00:00','2021-09-08 16:45:00','04:00:00','Pose carreaux de faïence et joint ciment','Non',NULL,2,1,129,'2021-09-13 09:02:42','2021-09-13 09:04:11'),(107,'2021-09-06','2021-09-06 15:00:00','2021-09-06 17:00:00','02:00:00','Pose de plinthes et de champ plats.','Respect des coupes d\'onglet.',NULL,1,1,186,'2021-09-13 09:06:35','2021-09-13 09:06:42'),(108,'2021-07-06','2021-07-06 10:00:00','2021-07-06 16:45:00','05:00:00','Pose d\'un plafond placo autoportant','Non',NULL,1,1,155,'2021-09-13 09:18:20','2021-09-13 09:18:26'),(109,'2021-10-07','2021-10-07 11:00:00','2021-10-07 17:00:00','05:00:00','-nettoyage et préparation du sole\r\n-prise de cote\r\n-traçage\r\n-calepinage\r\n-découpe des dalles et pose à blanc\r\n-application de la colle \r\n-pose des dalles \r\n','ras',NULL,2,1,264,'2021-09-13 10:51:37','2021