02','2021-09-15 08:38:07'),(141,'2021-09-13','2021-09-13 11:00:00','2021-09-13 12:00:00','01:00:00','Pose d\'un faux plafond en dalle placo','Non',NULL,1,1,162,'2021-09-15 08:49:15','2021-09-15 08:49:19'),(142,'2021-09-14','2021-09-14 14:00:00','2021-09-14 15:00:00','01:00:00','Port des EPI \r\nDémontage de l\'ancienne serrure et de la poignée\r\nAgrandissement du trou à l\'aide d\'une visseuse et d\'une mèche a bois pour passage de la nouvelle serrure\r\nEncastrer la nouvelle serrure (non présent sur la liste des matériaux utilisés) puis intégrer le cylindre de serrure et s\'assurer du bon maintien en les vissant de l\'extérieur\r\nRetouche de la gâche à la lime plate \r\nRemontage de la poignée neuve (avec passage de la serrure)\r\n','',NULL,3,2,133,'2021-09-15 09:07:41','2021-09-15 09:07:49'),(143,'2021-09-16','2021-09-14 14:45:00','2021-09-16 16:45:00','02:00:00','Remplacement serrure de la porte de la cabine par une serrure a double cylindre, avec poignée clé i. réglage et finition','Travaux réalisée',NULL,4,1,143,'2021-09-15 10:21:35','2021-09-26 07:24:45'),(144,'2021-09-13','2021-09-13 10:00:00','2021-09-13 12:00:00','02:00:00','Pose de plinthes bois et chant plat','Non',NULL,1,1,190,'2021-09-15 10:30:44','2021-09-15 10:30:49'),(145,'2021-09-15','2021-09-15 10:41:00','2021-09-15 10:50:00','00:10:00','mop','mopo',NULL,4,1,316,'2021-09-15 10:50:56','2021-09-15 10:52:19'),(146,'2021-09-13','2021-09-13 08:30:00','2021-09-13 16:45:00','05:00:00','Pose électricité','Non',NULL,5,1,270,'2021-09-15 11:07:21','2021-09-15 11:44:23'),(147,'2021-09-14','2021-09-14 15:15:00','2021-09-14 16:00:00','00:50:00','Être à 30 cm du tableau électrique\r\nLocaliser les pièces nus sous tension\r\nPrévenir le client qu\'on va devoir couper l\'alimentation général (disjoncteur de branchement) et ensuite consigner le disjoncteur de branchement à l\'aide d\'un condamnateur de disjoncteur et cadenas \r\nAprès avoir fermé le cadenas garder la clé dans votre poche \r\nEnsuite vérifier les EPI avec présence du double triangle (tapis non craqué, pas de trou dans les gants (non dans la liste) et le casque non détérioré avec écran facial et jugulaire)\r\nMettre ses EPI et mettre le tapis isolant à 30 cm du tableau\r\nVérifier présence de tension au tableau électrique avec un vérificateur d\'absence de tension (VAT)\r\nAvant de faire la vat le tester avant en touchant les deux bornes ensemble et il faut que ça sonne \r\nAprès vérification du bon fonctionnement du vat, sur le tableau électrique mettre une borne sur phase et l\'autre sur neutre (sonne pas donc pas de tension)\r\nEnsuite borne sur phase et l\'autre sur terre (pas de tension) \r\nEt borne sur neutre et l\'autre sur terre (pas de tension)\r\nRemettre en place et bien serrer les pnst à l\'aide du tournevis isolé tout en gardant ses EPI\r\nLa panne venait d\'un mauvais contact au niveau du télérupteur\r\nAprès vérification de non présence de pnst et que les fils sont bien visés\r\nPrévenir le client que je vais remettre l\'alimentation général donc je vais deconsigné en enlevant le cadenas et le condamnateur de disjoncteur (avec ou sans EPI car ce n\'est pas obligatoire)\r\nEnsuite changer prise avec présence de tension\r\nBaliser la zone où nous allons intervenir\r\nPrendre les capuchons isolants\r\nUtilisé la pince à bec fin isolé (avec présence du double triangle)\r\nDéconnecter à l\'aide de la pince la phase en premier et mettre le capuchon, le neutre en deuxième et mettre le capuchon et finir avec la terre et mettre le capuchon\r\nSur la nouvelle prise connecter la terre en premier en enlevant soigneusement le fil du capuchon à l\'aide de pince \r\nReproduire la même étape pour le neutre et la phase (sens inverse)\r\nEnlever le balisage \r\nEnlever ses EPI et bien revérifier les gants en les gonflants et le mettre près de l\'oreille pour voir si il n\'y a pas de fuite\r\nEt ranger le tapis en l\'enroulant\r\n\r\n\r\n','',NULL,7,3,275,'2021-09-15 11:24:06','2021-09-27 15:58:37'),(148,'2021-09-14','2021-09-14 15:00:00','2021-09-14 16:00:00','01:00:00','Formation B1V et BR','',NULL,5,4,282,'2021-09-15 11:50:54','2021-09-15 14:04:16'),(149,'2021-09-15','2021-09-15 13:31:00','2021-09-15 13:33:00','00:20:00','Mise en peinture du mur delà cabine ','',NULL,4,3,236,'2021-09-15 14:01:08','2021-10-04 08:27:40'),(150,'2021-09-01','2021-09-01 13:20:00','2021-09-01 16:00:00','03:30:00','Branchement télérupteur et contacteur jour/nuit sur maquette','Non',NULL,7,3,298,'2021-09-15 14:07:29','2021-09-29 15:48:25'),(151,'2021-09-15','2021-09-15 15:20:00','2021-09-15 16:20:00','01:00:00','Changement serrure + cylindre européen + béquille ','Non',NULL,3,3,131,'2021-09-15 14:18:30','2021-09-15 14:21:54'),(152,'2021-09-14','2021-09-14 10:00:00','2021-09-14 11:00:00','01:00:00','Changement complet serrure.','Non',NULL,3,1,135,'2021-09-15 14:50:45','2021-09-15 14:57:46'),(153,'2021-09-14','2021-09-14 09:00:00','2021-09-14 00:00:00','03:00:00','Pose de revêtement mural.','Non',NULL,2,1,199,'2021-09-15 15:16:16','2021-09-15 15:25:16'),(154,'2021-09-10','2021-09-10 08:00:00','2021-09-10 14:00:00','05:00:00','pose de plinthes en sapin et champlat','ras',NULL,2,3,196,'2021-09-15 15:59:46','2021-09-15 16:09:54'),(155,'2021-09-15','2021-09-15 10:00:00','2021-09-15 14:00:00','03:00:00','remplacement d\'une serrure et canon et poignée de porte','ras',NULL,3,3,142,'2021-09-15 16:12:40','2021-09-15 16:30:26'),(156,'2021-07-08','2021-07-08 10:00:00','2021-07-15 16:33:00','05:00:00','installation de compteur électrique monophasée, et distribution d\'alimentation à partir d\'une boîte de dérivation.','ras ',NULL,5,1,274,'2021-09-15 16:43:31','2021-09-16 19:26:09'),(157,'2021-09-14','2021-09-14 08:01:00','2021-09-14 12:00:00','04:00:00','Mise en peinture des deux plafond après avoir été imprimés.','NON',NULL,1,1,214,'2021-09-15 20:36:50','2021-09-15 20:42:17'),(158,'2021-08-20','2021-08-23 10:00:00','2021-08-27 16:00:00','05:00:00','Réalisation d\'un circuit électrique. ','Les travaux ce son