 des joints 30cm en haut et en bat  ','',NULL,1,1,372,'2021-09-28 15:22:13','2021-09-28 15:23:58'),(209,'2020-09-24','2020-09-22 14:00:00','2020-09-27 15:00:00','10:00:00','Chantier déjà balisé avant de commencer\r\nJe m\'équipe de mes EPI\r\n\r\nPOSE DE LA STRUCTURE METALLIQUE :\r\n\r\nJe prends l’équerrage à 90° par rapport à la cloison existante avec une équerre de maçon.\r\nJe trace au sol l\'emplacement intérieur du rail et je coupe mon rail à la bonne longueur (175cm). \r\nAvec mon niveau laser je fais le marquage en partie haute.\r\nJe perce 5 trous au perforateur et je fixe mon rail au sol. Idem pour le rail haut avec des vis à Bois : 5\r\n\r\nJe prends le deuxième équerrage  au bout du rail précédemment posé,à 90° afin de construire mon L. je laisse un espace égal à une feuille de placo avant de fixé mon rail. Même principe que l\'étape précédente avec le report des côtes en haut, puis je fixe mes deux rails avec pose d\'un sabot de 15 cm sur le rail du sol pour la fixation de la porte. le rail du haut est posé en totalité. Je mesure l\'embrasure de la porte et je pose le dernier morceau de rail avec un sabot également.\r\nMes rails sont posés, je présente mes montants et je les sertis tout les 60 cm maxi(axe-axe) pour la 1ère partie, sans sertir le rail à l\'intérieur du L pour permettre le passage de la plaque de plâtre de l\'autre cloison.\r\n(ceux touchants une cloison sont seuls les autres sont doublés)\r\n\r\nJe fixe mes montants sur la deuxième partie en partant par la droite.\r\n\r\nJe présente maintenant le bloc-porte (sans l\'avoir \"ouvert\") entre les deux sabots, je fixe un montant de chaque côté de celle-ci. Je mets la porte d\'aplomb et je sertie ensuite les montants. \r\n\r\nJe réalise pour terminé un sabot au dessus de la porte et positionne les derniers montants.\r\n\r\nJe nettoie le chantier et je range les morceaux ou chutes métalliques dans le stock ou à la benne dechets métalliques. \r\n\r\nJ\'enlève les éléments qui maintiennent la porte d’équerre, et je vérifie son bon fonctionnement.\r\n\r\nPOSE DES PLAQUES DE PLÂTRE :\r\n\r\nJe découpe ma première plaque à la bonne hauteur et la positionne à l\'aide d\'une lève-plaques. je laisse 1 centimètre par rapport au sol. Je la positionne dans l\'angle créé afin de pouvoir venir fixer dessus le seul montant que j\'ai laissé volant.\r\nJe fixe ma plaque à l\'aide de vis à placo de 25 mm. 1 tout les 30 centimètres maximum (soit entre 34 et 38 vis par plaque complète avec des montants doubles au milieu).\r\n\r\nJe termine la pose de ma première cloison en réalisant (si nécessaire) une coupe contre la cloison existante afin de rattraper une éventuelle erreur d\'aplomb de celle-ci.\r\n\r\n\r\nJe continu la pose en limitant les espacements entre celles-ci pour éviter au maximum la pose de MAP.\r\nLa pose des 2 plaques de chaque côté de la porte a été réalisé à la verticale sur la hauteur totale de la cloison. une chute a servie à combler l\'espace au dessus.\r\n\r\nje nettoie mon chantier au fur et à mesure.\r\n\r\n\r\n\r\n','Boucher les espaces entre plaques de plâtre supérieurs à 3 mm',NULL,1,1,373,'2021-09-28 15:28:36','2021-09-29 09:03:45'),(210,'2021-09-23','2021-09-23 13:00:00','2021-09-23 17:00:00','04:00:00','Pose d\'une cloison de séparation et d\'une retombée en plaque de plâtre.\r\nMise en place des rails au sol et en haut.\r\nPose des montants et mise en place de la retombée avec des chutes de montant.\r\nVisage des plaques de plâtre après découpe sur la structure métallique.\r\n','réalisation des bandes.',NULL,1,1,374,'2021-09-28 15:29:06','2021-09-28 16:15:56'),(213,'2021-09-29','2021-09-29 13:00:00','2021-09-29 15:00:00','02:00:00','Réaliser entaillage sur carreau céramique à l\'aide d\'une disqueuse (non présente sur outils magasin) \r\nDécoller les gros morceaux à l\'aide du burin et massette\r\nNettoyer le support (aspirateur)\r\nRéaliser ragréage et attendre 24h \r\nRéaliser la coupe du carreau\r\nPréparer la mortier colle, l\'appliquer au sol à l\'aide d\'un peigne et coller le carreau\r\nMettre les croisillons de 4mm et baliser la zone \r\nLe lendemain mettre le joint mortier gris ','',NULL,4,3,342,'2021-09-28 15:31:25','2021-09-28 16:08:37'),(214,'2021-09-28','2021-09-28 10:01:00','2021-09-29 10:00:00','04:00:00','pose de toiles de verres et intisse ','',NULL,2,1,205,'2021-09-28 15:33:51','2021-09-29 21:26:32'),(215,'2021-09-28','2021-09-28 12:30:00','2021-09-28 14:30:00','02:00:00','installations des rails sur les bords et montant renforcer les montant avec une suspense au centre avec des joints installation du plafond avec joints.','',NULL,1,1,381,'2021-09-28 15:44:08','2021-09-28 15:44:27'),(216,'2020-09-24','2021-09-24 08:00:00','2021-09-28 09:00:00','04:00:00','Je m\'équipe de mes EPI et je vais vérifier le balisage du chantier.\r\n\r\nSTRUCTURE :\r\n\r\nJe prends les côtes en allant mesurer différentes cabines voisines.\r\n\r\nCette cloison est à poser en parallèle de notre première cloison créée et représente un L en 3D. la longueur total est de 175 cm et la portée au sol est de 30 cm côté droit.\r\n\r\nJe prends le côtes de chaque côté de cette cloison existante et avec mon niveau laser je marque le positionnement haut du rail. Je trace au crayon l\'emplacement intérieur ou extérieur haut et bas.\r\nJe fixe mes rails bas avec des chevilles à frapper en faisant des trous de 6 mm avec un perforateur électrique, puis le rail haut avec des vis.\r\n\r\nJe présente les 2 montants de la retombée (30 cm fini au sol), je les mets d\'aplomb et les sertis.\r\npour la cloison haut de 20 centimètres de hauteur et 145 cm le longueur je coupe un rail de 160 cm et réalise des sabots de parts et d\'autres afin de fixer ces sabots sur une structure plus rigide. je positionne maintenant mes montants et les sertis.\r\nJe dépose les déchets métalliques dans le seau prévu à cette effet.\r\nJe range les chutes métalliques \r\n\r\nPLACO :\r\n\r\nPour la partie appuyée au sol je découpe 2 plaques de plâtre de la hauteur voulue moins 1 cm (249 cm) puis sur la largueur je laisse 13 mm de plus afin de pouvoir combler avec une bande de placo de 48 mm. je fixe ces 3 plaques avec des vis à placo de 25 mm en respectant l\'écartement de 30 cm entre chaque vis.\r\n\r\nPour la partie haut, même processus que précédemment. Sur la hauteur je laisse 13 mm de plus que la hauteur de la structure et sur la longueur j\'ajuste au mieux. je fixe l\'ensemble dans les règles de l\'art.\r\n\r\nJe nettoie le chantier au fur et à mesure. j\'ai un seau pour déchets placo et un seau pour déchets métalliques à proximité. \r\n','vérification et rebouchage au MAP si nécessaire',NULL,1,1,376,'2021-09-28 15:51:47','2021-09-29 09:11:37'),(217,'2021-09-29','2021-09-29 08:00:00','2021-09-29 11:00:00','03:00:00','Faire de l\'enduit de finition pour amélioration de la bande au plafond\r\nAppliquer sur la bande l\'enduit et le ratisser au maximum\r\nLaisser sécher 1h30 puis poncer la bande\r\nDépoussiérer le plafond et faire les rechampis et appliquer la peinture mat blanche au plat','',NULL,2,3,340,'2021-09-28 16:13:24','2021-09-28 16:45:01'),(218,'2021-09-22','2021-09-22 10:00:00','2021-09-22 17:00:00','01:40:00','Pose de faïence au fond de la cabine et réalisation des joints en blanc.\r\n','',NULL,2,1,180,'2021-09-28 16:16:38','2021-09-28 16:37:42'),(219,'2021-09-22','2021-09-22 13:00:00','2021-09-23 16:30:00','07:00:00','gants chaussures de securité casque outils utilisés joints vice perceuse règle a maçon niveau escabeau cutter crayon dimensions 240 de longueur et 140 de largeur l\'emplacement des rails en forme de L l\'intervention réalisé selon les mesures du sol des rails et des placos nettoyage des locaux après les travaux ','',NULL,1,1,375,'2021-09-28 16:21:48','2021-09-28 16:22:24'),(220,'2021-09-27','2021-09-27 09:00:00','2021-09-28 10:00:00','03:00:00','Pose d\'une retombée de 20 cm par 175 cm.\r\nMise en place d\'une traverse en bois pour la pose du rail supérieur de la retombée.\r\nMise en place du rail inférieur de la retombée avec un maximum de chutes de montant.\r\nPuis pose des plaques de plâtre après les avoir découpée dans un maximum de chute de plaque de plâtre.\r\n\r\n','Bandes de plâtre à réaliser',NULL,1,1,377,'2021-09-28 16:24:03','2021-09-29 09:23:40'),(221,'2021-09-28','2021-09-28 16:36:00','2021-09-28 16:47:00','00:10:00','pom','pom',NULL,1,1,388,'2021-09-28 16:37:39','2021-09-28 16:37:59'),(222,'2021-09-28','2021-09-28 16:36:00','2021-09-28 16:48:00','00:10:00','pm','pom',NULL,1,1,388,'2021-09-28 16:39:18','2021-09-28 16:39:32'),(223,'2021-09-13','2021-09-28 10:00:00','2021-09-28 12:00:00','02:00:00','Pose de plinthe et champlat autour d une porte','',NULL,1,1,189,'2021-09-28 16:53:57','2021-09-28 16:54:16'),(224,'2021-09-24','2021-09-24 14:00:00','2021-09-27 11:00:00','02:00:00','Pose d\'une retombée sur le devant de la cabine. longueur 175 cm hauteur 20 cm\r\n\r\nPort des EPI et vérification du balisage du chantier.\r\n\r\nPOSE DE LA STRUCTURE :\r\n\r\nCette retombée est parallèle à la précédente déjà réalisée.\r\n\r\nA partir de cette 1ère cloison et d\'après mon plan, je mesure de chaque côté la côte nécessaire entre les deux cloisons et je vérifie avec le niveau laser la concordance des points.\r\n\r\nJe marque à plusieurs endroit sur le trait du laser des repères.\r\n\r\nJe trace et découpe mon rail à la bonne longueur 175 cm. Je le fixe en partie haute avec 5 vis à bois.\r\n\r\nDécoupe d\'un rail de 205 cm avec élaboration de 2 sabots de 15 cm à chaque extrémité pour le fixer sur les parties latérales et assurer une meilleure rigidité de l\'ensemble. La fixation s\'effectue avec 2 vis à bois côté OSB et 2 vis à placo côté gauche avec pose d\'un renfort arrière.\r\n\r\nJe découpe maintenant 4 petits morceaux de montants que je les sertis. 1 à chaque extrémité puis 1 à 60 cm et l\'autre à 120 cm. je marque des repères pour mes montants centraux.\r\n\r\nStructure terminée, je mets les déchets dans la benne prévue à cette effet, je balaye si nécessaire.\r\n\r\nPOSE DU PLACO :\r\n\r\nPour la découpe des plaques de plâtre j\'utilise une règle de maçon de 3 mètres, 1 cutter et une scie à placo. \r\n\r\nJe mesure la longueur haute et basse de la structure pour ajuster au mieux les plaques verticales. A la mesure de la hauteur, je rajoute 13 mm correspondants à l\'épaisseur de la plaque de plâtre. Je découpe mes 2 plaques et les fixes avec 8 vis à placo chacune.\r\n\r\nJe termine en découpant le bandeau horizontal de 48 mm de large que je fixe avec 4 vis à placo.\r\n\r\nJe mets les déchets dans la benne prévue à cette effet, je balaie. \r\n\r\n\r\n\r\n \r\n\r\n','rebouchage au MAP',NULL,1,1,379,'2021-09-28 19:12:01','2021-09-29 09:16:58'),(225,'2021-09-16','2021-09-16 08:00:00','2021-09-16 14:15:00','03:00:00','Questionnaire et épreuves pratiques.\r\n. Consignation\r\n. Observation\r\n. Recherche \r\n. Interventions\r\n. Ballissage(sécurité) \r\nVérifier les EPI(tapis isolant, casque visière, gants latex, gants entchoc)\r\nIntervention sur circuit inter lampe.\r\nIntervention sur prise électrique défectueux\r\nEntretient avec formateur sur le questionnaire ','',NULL,5,4,284,'2021-09-28 20:16:23','2021-09-28 21:27:09'),(226,'2021-07-05','2021-07-05 10:00:00','2021-07-09 10:00:00','08:00:00','Mise en place d\'un câble pour l\'alimentation de la boîte de dérivation au tableau électrique.\r\n. Prendre les côtes et les marquer, pour chaque élément (prise interrupteur appliqué lumineux, tableau électrique)\r\n. Percer à la scies cloche adapter les trou pour les prise et interrupteur. \r\n','',NULL,5,1,291,'2021-09-28 20:19:52','2021-09-28 21:57:25'),(227,'2021-09-28','2021-09-28 20:22:00','2021-09-28 20:22:00','01:20:00','Uu',NULL,NULL,6,2,300,'2021-09-28 20:22:44',NULL),(228,'2021-09-28','2021-09-28 10:30:00','2021-09-28 14:00:00','02:30:00','Pose d\'un plafond en placo avec une structure métallique rails-montants\r\n\r\nJe m\'équipe de mes EPI et vérifie le balisage du chantier.\r\n\r\nPOSE DE LA STRUCTURE :\r\n\r\nJe vais poser une structure rectangulaire, d\'après la cote donnée par le formateur. Je fait un report de mon trait d\'emprunt et je rajoute 13 mm.\r\n\r\nA l\'œil et à hauteur du report fait, je fixe verticalement une chute de rail dans la structure avec une vis à placo de 55 mm. cela va servir à supporter le support aimanté de mon niveau laser. je pose mon niveau laser et ajuste la mire horizontale sur mon report. Je trace des reports sur les côtés à railler. \r\n\r\nJe découpe et pose mes rails et je profite de la structure existante pour fixer mes vis. \r\n\r\nJe découpe mes 6 petits morceaux de montants. 2 de chaque côtés et 4 jumelés par 2 pour le centre. je les sertis dans les rails.\r\n\r\nMa structure est terminée je dépose les chutes dans la benne ou le seau pour les plus petits.\r\n\r\nPOSE DU PLACO :\r\n\r\nJe vérifie avec une chute de placo suffisamment grande le bon équerrage des angles. De l\'angle le plus droit, je mesure la longueur et la largueur et les reportes sur la plaque finale. De ces 2 points je report la longueur et la largueur non encore mesurées et les faits se rencontrer en un point par des arcs de cercle. je découpe et présente ma plaque. \r\n\r\nJe vise en respectant la règle des 30 cms entre chaque vis.   \r\n\r\nJe dépose les petites chutes dans la benne, je range les grandes et balaie mon chantier.\r\n','rebouchage au MAP si nécessaire',NULL,1,1,382,'2021-09-28 21:45:46','2021-09-29 09:32:48'),(229,'2021-09-29','2021-09-29 10:00:00','2021-09-29 14:30:00','02:30:00','Construction d\'une gaine technique de 30x15 cm\r\n\r\nJe m\'équipe de mes EPI et je vérifie le balisage du chantier.\r\n\r\n\r\nSTRUCTURE DE 15 CM :\r\n\r\n1 ) Je prends les cotes hautes et basses et réalise un marquage (à 30 cm de l\'angle droit de départ).\r\n\r\nJe vérifie la verticalité des 2 points avec mon niveau laser et je prends comme référence le point le plus à l\'extérieur. Je trace mon trait verticale en déduisant 13 mm.\r\n\r\n2) Le prends mon équerre pour tracer au sol l\'emplacement du rail et transfert au plafond le marquage à l\'aide du niveau laser.\r\n\r\nFixation du rail au sol avec 2 chevilles à frapper et au plafond par 2 chevilles à expansion. il est nécessaire de faire des trous avec une foret à métal pour le haut et de faire un repérage avant de fixer les chevilles.\r\nJe réalise aussi bien en haut que en bas un sabot de 15 cm pour verrouiller le montant à l’extrémité. \r\n\r\nJe mesure et découpe maintenant mes 2 montants. Pour celui à fixer contre la cloison en placo je réalise des 3 trous avec une mèche à métal. Je la présente et fait un marquage des trous sur la plaque de plâtre. Je fais des trous de 8 mm dans le plaque de plâtre avec visseuse et mèche adaptées, je fixe mes chevilles à expansion afin une pince adaptée. je fixe.\r\nJe sertis ensuite le 2ème montant. \r\n\r\nSTRUCTURE 30 CM\r\n\r\nJe reproduit la procédure 1) mais à 15 cm de l\'autre côté de l\'angle droit.\r\n\r\nJe trace mes traits haut et bas en partant de mon repère en m\'alignant sur le rail précédemment posé. je découpe mes rails, fixe celui du haut, perce les trous au sol pour celui du bas mais je ne le fixe pas.\r\n\r\nje découpe mes montants, perce 3 trous à la mèche métallique dans un des deux pour le fixer contre la cloison en placo. je fixe mes 3 chevilles verticales.\r\n\r\nJe suis prêt a fixer la structure. j’emboîte mes montants dans le rail haut puis bas et je positionne les trous de rail bas en face des trous réalisés dans la dalle. je fixe mes 2 chevilles à frapper, je fixe mes 3 vis dans les chevilles à expansion et j\'assemble pour terminer les 2 montants situés dans l\'angle.\r\n\r\nStructure terminée, je dépose les chutes dans la benne dédiée à cette effet.\r\n\r\nPOSE DU PLACO.\r\n\r\nJe découpe en premier la plaque de 15 cm et la fixe à 1 cm du sol. vis tout les 30 cm.\r\n\r\nJe présente ensuite une plaque pour retour. elle sera 3 à 4 cm trop large.\r\nje marque celle-ci intérieurement en traçant le long de la plaque déjà posée.\r\n\r\nJe découpe à la scie à placo. Je représente et fixe cette fois ma plaque.\r\n\r\nJ\'ajuste l\'angle droit avec une rappe et un cutter.\r\n\r\nMon chantier est terminé, je balaie et dépose les petits déchets dans la poubelle, les plus grands sont conservés.\r\n\r\nDIFFICULTÉS RENCONTRÉES :\r\n\r\nTechniquement aucune difficulté. \r\nMatériel mis à disposition de bonne qualité avec un très large éventail.\r\nL\'utilisation du référentiel SINIAT à été un élément nécessaire pour connaitre la bonne mise en œuvre des structures et des plaques. \r\nJe suis très content de notre réalisation. \r\nJe pense que cette partie \"Maintenance des aménagements intérieurs\" est celle que je maîtrise le mieux.\r\n\r\nENTENTE AVEC LES COLLÈGUES :\r\n\r\nAucun problème relationnel avec mes collègues quelque soit la session.\r\nGlobalement souriants et disponibles\r\n\r\nTravail en trinôme pas très facile :\r\n- difficile de travailler dans un espace réduit efficacement,\r\n- pas le même niveau d\'expérience et/ou de compétences,\r\n- pas le même dynamisme,\r\n- pas les mêmes besoins (j\'ai envie de découvrir le maximum de choses durant cette formation).\r\n \r\nje prends cependant du temps pour expliquer, responsabiliser, vérifier la bonne compréhension de l\'action entreprise, à celui ayant le moins d\'expérience.\r\nCela est normal de partager, le tout dans la bonne humeur!!! mais il me serait difficile de me substituer au formateur.\r\n\r\n\r\n','',NULL,1,1,385,'2021-09-28 22:29:47','2021-09-29 21:32:28'),(230,'2021-09-29','2021-09-29 09:30:00','2021-09-29 11:30:00','02:00:00','Pose d\'un lave main sur faience ',NULL,NULL,8,1,319,'2021-09-29 09:21:00',NULL),(231,'2021-09-30','2021-09-30 08:00:00','2021-09-30 17:00:00','08:00:00','Pose d\'un wc et de ces alimentation et évacuation',NULL,NULL,8,1,356,'2021-09-29 09:24:05',NULL),(232,'2021-10-04','2021-11-04 10:00:00','2021-11-04 15:00:00','04:00:00','Pose d\'un revêtement mural type toile de verre',NULL,N