INSERT INTO `amb_fichesinterventions` VALUES (1,'2021-05-06','Villattef Franck','0646201634','Répondre aux questionnaire que vous a transmis votre formateur dans le compte rendu de la fiche d\'intervention.\r\n\r\nVous avez 30 minutes pour répondre.\r\n\r\nVous n\'avez droit à aucune documentation, ni recherche sur internet.\r\n\r\nExemple : 1) A ; 2) C',2,0,'',7,48,1,4,10,NULL,'2021-05-06 10:50:20','2021-09-29 15:42:08'),(3,'2021-05-06','Villattef Franck','0646201634','Répondre aux questionnaire envoyé par mail sur le compte rendu de la fiche d\'intervention\r\n\r\nExemple : 1) A ; 2) C',3,0,'',7,23,1,1,10,NULL,'2021-05-06 11:03:39','2021-09-09 15:01:42'),(4,'2021-05-06','Villattef Franck','0646201634','Répondre aux questionnaire envoyé par mail sur le compte rendu de la fiche d\'intervention\r\n\r\nExemple : 1) A ; 2) C',2,0,'',7,23,1,1,10,NULL,'2021-05-06 11:10:06','2021-09-29 15:42:27'),(5,'2021-05-06','Villattef Franck','0646201634','Questionnaire',5,0,'Trop d\'erreur. Questionnaire à refaire ultérieurement',7,23,1,4,10,NULL,'2021-05-06 13:46:43','2021-05-06 13:56:56'),(6,'2021-05-18','Villattef Franck','0646201634','Graisser les gonds',5,0,'Tu as mis de la graisse sur la poignée de porte',7,13,17,3,10,NULL,'2021-05-18 14:53:48','2021-05-18 15:23:05'),(7,'2021-05-18','Villattef Franck','0646201634','Déconstruction des épreuves de certification du groupe précédent.\r\nPoints de vigilance : \r\n- port des EPI\r\n- tri des déchets\r\n- récupération des matériaux\r\n- utilisation des outils correspondant aux tâches de déconstructions\r\n',4,1,'validation de la fiche.\r\nJ\'attend plus de détail dans le compte rendu pour les prochaines fiches.\r\nTravail réalisé méthodique, le tri est effectué.',7,24,2,4,19,NULL,'2021-05-28 08:20:51','2021-06-10 12:14:42'),(8,'2021-05-18','Villattef Franck','0646201634','Déconstruction des épreuves de certification du groupe précédent.\r\nPoints de vigilance : \r\n- port des EPI\r\n- tri des déchets\r\n- récupération des matériaux\r\n- utilisation des outils correspondant aux tâches de déconstructions\r\n',4,1,'Bravo concernant la description des taches effectuées.\r\n\r\nTravail réalisé conforme aux exigences attendues.\r\n\r\n',7,24,2,4,20,NULL,'2021-05-28 08:20:51','2021-06-10 12:16:43'),(9,'2021-05-18','Villattef Franck','0646201634','Déconstruction des épreuves de certification du groupe précédent.\r\nPoints de vigilance : \r\n- port des EPI\r\n- tri des déchets\r\n- récupération des matériaux\r\n- utilisation des outils correspondant aux tâches de déconstructions\r\n',4,1,'Plus de précision dans le compte rendu d\'intervention serait nécessaire.\r\nExemple : \r\ntri des déchets dans différentes benne : DIB...\r\npas de problèmes particulier dans la réalisation\r\nj\'aurai préféré...\r\n...',7,24,2,4,21,NULL,'2021-05-28 08:20:51','2021-06-09 16:29:26'),(10,'2021-05-27','Villattef Franck','0646201634','Dans le cadre de la mise en place de l\'atelier AMB, construction de 8 cabines de formation AMB correspondant au modèle permettant la certification.\r\n\r\nLa réalisation doit être conforme aux consignes du formateur.\r\n\r\nCritères d\'évaluations : \r\n- le travail d\'équipe\r\n- l\'emploi d\'outils adaptés aux différentes tâches à effectuer\r\n- le respect des côtes\r\n- le respect des alignements et de l\'équerrage\r\n- le port des EPI',4,1,'Conforme à la demande',7,25,1,4,19,NULL,'2021-05-28 08:35:32','2021-06-16 15:49:12'),(11,'2021-05-27','Villattef Franck','0646201634','Dans le cadre de la mise en place de l\'atelier AMB, construction de 8 cabines de formation AMB correspondant au modèle permettant la certification.\r\n\r\nLa réalisation doit être conforme aux consignes du formateur.\r\n\r\nCritères d\'évaluations : \r\n- le travail d\'équipe\r\n- l\'emploi d\'outils adaptés aux différentes tâches à effectuer\r\n- le respect des côtes\r\n- le respect des alignements et de l\'équerrage\r\n- le port des EPI',1,0,NULL,7,25,1,4,12,NULL,'2021-05-28 08:35:32',NULL),(12,'2021-05-27','Villattef Franck','0646201634','Dans le cadre de la mise en place de l\'atelier AMB, construction de 8 cabines de formation AMB correspondant au modèle permettant la certification.\r\n\r\nLa réalisation doit être conforme aux consignes du formateur.\r\n\r\nCritères d\'évaluations : \r\n- le travail d\'équipe\r\n- l\'emploi d\'outils adaptés aux différentes tâches à effectuer\r\n- le respect des côtes\r\n- le respect des alignements et de l\'équerrage\r\n- le port des EPI',4,1,'Réalisation conforme aux exigences',7,25,1,4,20,NULL,'2021-05-28 08:35:32','2021-06-10 12:17:53'),(13,'2021-05-27','Villattef Franck','0646201634','Dans le cadre de la mise en place de l\'atelier AMB, construction de 8 cabines de formation AMB correspondant au modèle permettant la certification.\r\n\r\nLa réalisation doit être conforme aux consignes du formateur.\r\n\r\nCritères d\'évaluations : \r\n- le travail d\'équipe\r\n- l\'emploi d\'outils adaptés aux différentes tâches à effectuer\r\n- le respect des côtes\r\n- le respect des alignements et de l\'équerrage\r\n- le port des EPI',4,1,'Bon travail. \r\nConforme/éxigences',7,25,1,4,21,NULL,'2021-05-28 08:35:32','2021-06-09 16:34:01'),(14,'2021-05-27','Villattef Franck','0646201634','Dans le cadre de la mise en place de l\'atelier AMB, construction de 8 cabines de formation AMB correspondant au modèle permettant la certification.\r\n\r\nLa réalisation doit être conforme aux consignes du formateur.\r\n\r\nCritères d\'évaluations : \r\n- le travail d\'équipe\r\n- l\'emploi d\'outils adaptés aux différentes tâches à effectuer\r\n- le respect des côtes\r\n- le respect des alignements et de l\'équerrage\r\n- le port des EPI',4,1,'Travaux réalisé conformément à la demande',7,25,1,4,22,NULL,'2021-05-28 08:35:32','2021-06-07 15:09:07'),(15,NULL,'Administrateur','0745821463','Réalisation d\'un plafond technique en dalles de 60x60 cm de l\'entrée de la cabine jusqu\'à la retombé.\r\nPour plus de renseignement, voir avec le demandeur.\r\n\r\nCritères d\'appréciations : \r\nPort des EPI\r\nHorizontalité et niveau du plafond\r\nMise en place de la structure métallique (porteur, entretoise)\r\nLa pose et découpe des dalles de plafond\r\nLa propreté du plafond technique (pas de trace)\r\nLa propreté des lieux\r\nL\'utilisation du matériel adapté\r\nLe compte rendu d\'intervention',1,0,NULL,1,1,9,4,NULL,NULL,'2021-06-02 14:10:25','2021-06-02 16:21:57'),(16,NULL,'Administrateur','0640893009','Répondre au questionnaire de 22 questions que vous a transmis votre formateur.\r\nVous avez 30 minutes pour répondre.\r\nLes réponses sont a déposé dans le compte rendu d\'intervention.\r\n\r\nExemple : \r\n1) A\r\n2) A et B\r\n…\r\n\r\nCritère d\'appréciation :\r\n\r\nAu minimum 17 réponses justes pour validation de la fiche\r\n',1,0,NULL,2,23,1,4,NULL,NULL,'2021-06-02 14:24:08',NULL),(17,NULL,'Administrateur','0640893009','Réalisation de la déconstruction des ouvrages réalisés dans la cabine.\r\nL\'ossature de la cabine reste en place.\r\nLa cloison qui se situe a droite en rentrant dans la cabine reste en place ainsi que la plaque d\'OSB et le matériel électrique disposé dessus.\r\nLes consignes de déconstruction sont données par le formateur.\r\n\r\nCritères d\'appréciations : \r\nPort des EPI\r\nLogique dans la déconstruction\r\nMise en place d\'un balisage de sécurité\r\nTri des déchets\r\nRécupération du matériel à réutiliser et réintégration au magasin\r\nUtilisation des outils adéquats\r\nPropreté du travail',1,0,NULL,2,1,2,4,NULL,NULL,'2021-06-02 14:39:05',NULL),(18,NULL,'Administrateur','0640893009','Réalisation d\'une cloison de distribution en plaque de plâtre sur ossature métallique.\r\nCloison en L avec inclusion d\'un bloc porte.\r\nL\'emplacement et les dimensions sont fournis par le formateur.\r\n\r\nCritères d\'appréciations :\r\nRespect de l\'emplacement de la cloison, de la porte\r\nRespect des dimensions\r\nL\'aplomb des cloisons\r\nLe bon positionnement des montants\r\nLes découpes des plaques de plâtre\r\nLes points de vissages des plaques de plâtre\r\nL\'aplomb de la porte\r\nLa fermeture correcte de la porte\r\nLe port des EPI\r\nLa propreté des lieux\r\nL\'utilisation d\'outils adaptés\r\nL\'établissement du compte rendu sur la fiche d\'intervention',1,0,NULL,2,1,3,4,NULL,NULL,'2021-06-02 14:56:27',NULL),(19,NULL,'Administrateur','0640893009','Réalisation d\'une retombée et d\'une cloison de séparation en plaque de plâtre sur ossature métallique.\r\nDimensions et emplacement suivant les consignes du formateur.\r\n\r\nCritères d\'appréciations :\r\n\r\nRespect de l\'emplacement\r\nRespect des dimensions\r\nL\'aplomb\r\nle port des EPI\r\nL\'emploi des outils adaptés\r\nLe compte rendu d\'intervention\r\nLa propreté du travail et des locaux',1,0,NULL,2,1,5,4,NULL,NULL,'2021-06-02 15:03:52',NULL),(20,NULL,'Administrateur','0640893009','Réalisation d\'un plafond en plaque de plâtre sur ossature métallique (rails et montants).\r\nLe plafond se situe entre la retombée et le fond de la cabine.\r\nLa hauteur sous plafond est à déterminée avec le formateur.\r\n\r\nCritères d\'appréciations :\r\nPort des EPI\r\nUtilisation du matériel adapté\r\nPropreté du travail et des locaux\r\nHorizontalité du plafond\r\nRespect des normes de pose de l\'ossature métallique\r\nLe compte rendu d\'intervention',1,0,NULL,2,1,4,4,NULL,NULL,'2021-06-02 15:15:47',NULL),(21,NULL,'Administrateur','0640893009','Construction d\'une gaine technique en plaque de plâtre sur ossature métallique.\r\nDimensions : 30 cm x 15 cm; hauteur : du sol au plafond\r\nSituation : au fond de la cabine a droite\r\n\r\nCritères d\'appréciations :\r\nPort des EPI\r\nRespect des dimensions\r\nL\'aplomb\r\nPropreté des lieux\r\nLe compte rendu d\'intervention',1,0,NULL,2,1,5,4,NULL,NULL,'2021-06-02 16:29:23',NULL),(22,NULL,'Administrateur','0640893009','Réalisation d\'une retombée de 20 cm sur le devant de la cabine, largeur : 1,75 ml.\r\nPour plus de renseignements contacter le demandeur.\r\n\r\nCritères d\'appréciations :\r\nLe port des EPI\r\nRespect de l\'emplacement et des dimensions\r\nLes coupes des plaques de plâtre\r\nLe montage de l\'ossature métallique\r\nLe balisage de la zone d\'intervention\r\nLe compte rendu d\'intervention',1,0,NULL,2,1,5,4,NULL,NULL,'2021-06-02 16:36:02',NULL),(23,NULL,'Administrateur','0640893009','Réalisation d\'un comptoir à l\'entrée de la cabine à gauche d\'une hauteur de 1,10 m, largeur 0,60 m, avec un retour de 20 cm.\r\n\r\n\r\nCritères d\'appréciations :\r\nPort des EPI\r\nL\'emplacement et les dimensions\r\nL\'aplomb, l\'équerrage\r\nL\'emploi des outils adaptés\r\nLa propreté global de l\'ouvrage\r\nLa propreté des lieux\r\nLe compte rendu de l\'intervention\r\n',1,0,NULL,2,1,5,4,NULL,NULL,'2021-06-02 16:52:46',NULL),(24,NULL,'Administrateur','0640893009','Pose d\'une tablette sur le dessus du comptoir : 30 cm x 65 cm.\r\nPose de plinthe bois sur le pourtour de l\'ouvrage.\r\n\r\nCritères d\'appréciations :\r\nPort des EPI\r\nRespect des dimensions\r\nJonction des angles de plinthes rentrants et sortants\r\nEmploi des outils adaptés\r\nRespect du niveau de la tablette\r\nEtat général de pose\r\nPropreté des lieux\r\nLe compte rendu d\'intervention',1,0,NULL,2,1,6,4,NULL,NULL,'2021-06-02 16:58:02',NULL),(25,NULL,'Administrateur','0640893009','Pose de plinthes bois sur les côtés de la porte et mise en place de champlat sur le pourtour de la porte de la cabine.\r\n\r\nCritères d\'appréciations :\r\nPort des EPI\r\nLes coupes et les angles sont nets\r\nLa pose des champlats est ajusté de façon régulière sur le pourtour de la porte\r\nLe travail réalisé est soigneux\r\nL\'emploi des outils est adapté\r\nLes locaux sont propres après l\'intervention\r\nLe compte rendu d\'intervention est clair et concis\r\n',1,0,NULL,2,1,6,4,NULL,NULL,'2021-06-04 10:41:41',NULL),(26,NULL,'Administrateur','0640893009','Remplacement de la serrure de la porte de la cabine par une serrure à cylindre.\r\n\r\nCritères d\'appréciations :\r\nPort des EPI\r\nLe système de condamnation fonctionne\r\nL\'intervention est réalisé proprement (pas de trace de salissure)\r\nLe rive bloc est ajusté\r\nLa compte rendu d\'intervention est renseigné judicieusement',1,0,NULL,2,1,8,4,NULL,NULL,'2021-06-04 11:12:40',NULL),(27,NULL,'Administrateur','0640893009','Pose de carrelage à l\'intérieur de la cabine au fond à droite.\r\nPour de plus amples renseignements contacter le demandeur.\r\n\r\nCritères d\'appréciation :\r\nPort des EPI\r\nLe demandeur à été contacté, l\'échange est constructif et poli\r\nLa pose est plane\r\nLe calepinage est conforme\r\nLa dimension des joints est identique sur l\'ensemble de la pose\r\nLes plinthes sont posé de façon harmonieuse\r\nLes joints sont réalisés et conforme  \r\nLa zone est balisée\r\nLes lieux sont propres\r\nLe demandeur à été recontacté en fin d\'intervention\r\nLe compte rendu d\'intervention est rempli correctement',1,0,NULL,2,1,10,4,NULL,NULL,'2021-06-04 11:29:09',NULL),(28,'2021-06-07','Administrateur','0640893009','Répondre au questionnaire de 22 questions que vous a transmis votre formateur.\r\nVous avez 30 minutes pour répondre.\r\nLes réponses sont a déposé dans le compte rendu d\'intervention.\r\n\r\nExemple : \r\n1) A\r\n2) A et B\r\n…\r\n\r\nCritère d\'appréciation :\r\n\r\nAu minimum 17 réponses justes pour validation de la fiche\r\n',5,0,'problème d\'enregistrement, remise en cours de la fiche',7,23,1,4,19,NULL,'2021-06-07 10:30:04','2021-06-07 15:17:18'),(29,'2021-06-07','Administrateur','0640893009','Répondre au questionnaire de 22 questions que vous a transmis votre formateur.\r\nVous avez 30 minutes pour répondre.\r\nLes réponses sont a déposé dans le compte rendu d\'intervention.\r\n\r\nExemple : \r\n1) A\r\n2) A et B\r\n…\r\n\r\nCritère d\'appréciation :\r\n\r\nAu minimum 17 réponses justes pour validation de la fiche\r\n',4,1,'Pense à mettre la date d\'intervention dans ton compte rendu\r\n\r\n1 erreur :\r\nla N°17\r\n\r\nBon travail',7,23,1,4,20,NULL,'2021-06-07 10:31:02','2021-0